  `id` int(16) UNSIGNED NOT NULL,
  `by_id` int(10) UNSIGNED NOT NULL COMMENT '購買者編號',
  `member_id` int(11) UNSIGNED NOT NULL COMMENT '哪個會員平台上購買的',
  `FID` int(11) DEFAULT NULL COMMENT '體系編號',
  `warehouse_id` int(10) NOT NULL DEFAULT '0' COMMENT '出貨倉庫ID',
  `order_id` varchar(32) NOT NULL,
  `status` int(2) NOT NULL COMMENT '訂單狀態, 0:未付款, 1:已付款, 2:退款,3:匯款通知',
  `product_flow` tinyint(4) NOT NULL COMMENT '0:新訂單, 1:處理中, 2:已出貨, 3:取消交易, 4: 完成交易, 5:已退貨, 6:換貨,7:申請退貨8.交易失敗',
  `details` text NOT NULL,
  `alipay_id` varchar(255) DEFAULT NULL COMMENT '支付宝訂單編號',
  `alipay_status` varchar(255) DEFAULT NULL COMMENT '支付宝验证狀態',
  `is_bonus` enum('Y','N') NOT NULL DEFAULT 'N' COMMENT '是否發送紅利',
  `bonus` decimal(60,2) NOT NULL DEFAULT '0.00' COMMENT '此訂單的紅利',
  `total_price` varchar(255) NOT NULL COMMENT '總計金額',
  `pay_price` varchar(255) DEFAULT NULL COMMENT '不包括運費的總額',
  `use_dividend` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '使用紅利點數',
  `use_dividend_cost` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '使用紅利折抵多少錢',
  `use_shopping_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '使用購物金',
  `price_money` decimal(60,2) NOT NULL DEFAULT '0.00' COMMENT '真正付的錢',
  `total_pv` varchar(255) NOT NULL,
  `total_lv` varchar(255) NOT NULL,
  `name` varchar(32) NOT NULL COMMENT '收件人姓名',
  `phone` varchar(10) NOT NULL COMMENT '收件人手機',
  `email` varchar(255) NOT NULL COMMENT '收件人信箱',
  `zip` varchar(10) NOT NULL COMMENT '收件人地址 - 郵遞區號',
  `country` varchar(8) DEFAULT NULL COMMENT '收件人地址 - 國家',
  `county` varchar(8) DEFAULT NULL COMMENT '收件人地址 - 縣市',
  `area` varchar(255) DEFAULT NULL COMMENT '收件人地址 - 地區',
  `address` varchar(255) NOT NULL COMMENT '收件人地址 - 門牌',
  `buyer_note` text,
  `receipt_num` varchar(255) DEFAULT NULL COMMENT '發票號碼',
  `receipt_title` varchar(255) NOT NULL COMMENT '發票抬頭',
  `receipt_code` varchar(255) NOT NULL COMMENT '發票統編',
  `receipt_zip` varchar(6) NOT NULL COMMENT '發票地址 - 郵遞區號',
  `receipt_county` varchar(8) NOT NULL COMMENT '發票地址 - 縣市',
  `receipt_area` varchar(8) NOT NULL COMMENT '發票地址 - 地區',
  `receipt_address` varchar(255) NOT NULL COMMENT '發票地址 - 門牌',
  `pay_way_id` int(10) NOT NULL COMMENT '付款方式 - id',
  `shop_id` varchar(255) DEFAULT NULL COMMENT '哪間商場member_id',
  `iqrt_id` int(16) NOT NULL,
  `lway_iqrt_id` varchar(16) NOT NULL,
  `lway_id` tinyint(1) NOT NULL,
  `lway_price` varchar(10) NOT NULL DEFAULT '0' COMMENT '運費',
  `card_owner` int(10) NOT NULL COMMENT '來源 - 會員id',
  `date` varchar(10) NOT NULL COMMENT '訂單寫入時間',
  `trade_no` varchar(20) NOT NULL,
  `taishin_no` varchar(23) DEFAULT NULL COMMENT 'Taishin 訂單號碼',
  `allpay_no` varchar(20) NOT NULL COMMENT 'allpay 交易單號',
  `gid` varchar(255) NOT NULL,
  `gomypay_no` varchar(20) NOT NULL,
  `taishin_code` varchar(5) DEFAULT NULL,
  `taishin_message` varchar(255) DEFAULT NULL,
  `trade_date` date NOT NULL COMMENT '付款時間',
  `alipay_trade_date` datetime NOT NULL COMMENT '支付寶付款時間',
  `atmpayment` date DEFAULT NULL COMMENT 'atm繳款期限',
  `stage` int(11) NOT NULL COMMENT '分期期數',
  `stast` int(11) NOT NULL COMMENT '頭期金額',
  `staed` int(11) NOT NULL COMMENT '各期金額',
  `card4no` varchar(4) NOT NULL COMMENT '卡片末四碼',
  `card6no` varchar(6) NOT NULL COMMENT '卡片前六碼',
  `atmno` varchar(5) DEFAULT NULL COMMENT 'ATM匯款後五碼',
  `atmdate` date DEFAULT NULL COMMENT '匯款日期',
  `note` text NOT NULL COMMENT '後台備註',
  `d_status` enum('N','Y') NOT NULL DEFAULT 'N' COMMENT '是否忽略算獎金? Y>忽略',
  `device` tinyint(1) NOT NULL COMMENT '1:mobile',
  `device_type` varchar(4) NOT NULL,
  `create_time` datetime NOT NULL COMMENT '訂單建立時間',
  `update_time` datetime NOT NULL COMMENT '修改時間',
  `deadline` date NOT NULL COMMENT '在這天之前可退貨',
  `receipt_date` date NOT NULL COMMENT '發票日期',
  `tracking_name` varchar(60) DEFAULT NULL COMMENT '物流公司名稱',
  `tracking_num` varchar(45) NOT NULL COMMENT '物流編號',
  `sale_out_date` date DEFAULT NULL,
  `backbrush_date` datetime NOT NULL,
  `back_date` date NOT NULL COMMENT '退貨日期',
  `back_name` varchar(45) NOT NULL COMMENT '退款者姓名',
  `back_bank` varchar(45) NOT NULL COMMENT '退款銀行',
  `back_account` varchar(45) NOT NULL COMMENT '退款帳戶',
  `back_note` text NOT NULL COMMENT '退款備註',
  `apply_back_date` date DEFAULT NULL COMMENT '申請退貨日期',
  `back_pic` varchar(255) DEFAULT NULL
