INSERT INTO `ckeditor` VALUES(32, NULL, 'Fragrance Aesthetics', 'Nature is regarded the primary fountain of delight of human being. Fragrance Aesthetics, established by Singapore-based Vital Wellspring Education Private Company in 2017, is a dietary health-maintenance platform reinforcing on the concept of searching for ingredients utilized from the mother nature. Conceptually-stated, its origin is stemming from fragrance, assimilating the exquisite natural diet with the idiosyncratic taste of aesthetics, authentically bringing patrons an unparalleled consumption experience.<br />\n<br />\nComprised by experts ranging from the sectors of agriculture, medicine aligned with food science in Asia, Fragrance Aesthetics puts emphasis on unearthing the most natural and pristine dietary source while preserving the nutrition during the processing procedures, genuinely disclosing the most primitive flavor in line with pure beauty of ingredients. Steadfastly, we are aiming for developing food products beneficial for wellbeing maintenance commencing from the natural origin. Through the stringent certification process, exclusive fusion over the transnational unique raw materials, Fragrance Aesthetics, the genuine healthy diet innovator, retains the tradition while evoking ingenuity.', 0, '1', '1', 'ENG', NULL, '2019-12-19 11:48:52');
