INSERT INTO `ckeditor` VALUES(47, NULL, '兩大回饋機制', '<div>\n<p><strong>#</strong><strong>兩大</strong><strong>回饋機制</strong></p>\n\n<ol>\n	<li>紅利回饋：一般會員及經營會員皆可享有紅利回饋</li>\n	<li>購物金回饋：經營會員才能享有購物金回饋<span style=\"font-family:微軟正黑體; font-size:12pt\">&nbsp;</span></li>\n</ol>\n\n<p><br />\n<strong>#回饋說明</strong><br />\n&nbsp;</p>\n\n<p><strong># </strong><strong>使用說明</strong></p>\n\n<p style=\"margin-left:24pt\"><span style=\"font-family:wingdings\"></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:微軟正黑體\">紅利回饋及購物金回饋</span><span style=\"font-family:微軟正黑體\">，</span><span style=\"font-family:微軟正黑體\">皆</span><span style=\"font-family:微軟正黑體\">須扣除退貨商品，依實際付款金額之比例發送。</span></p>\n\n<p style=\"margin-left:24pt\"><span style=\"font-family:wingdings\"></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:微軟正黑體\">使用紅利點數折抵，若遇訂單取消狀況，點數會自動歸還，但使用期限不展延。</span></p>\n\n<p style=\"margin-left:24pt\"><span style=\"font-family:wingdings\"></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:微軟正黑體\">使用購物金，</span><span style=\"font-family:微軟正黑體\">若遇訂單取消狀況，</span><span style=\"font-family:微軟正黑體\">購物金會自動歸還。</span></p>\n\n<p style=\"margin-left:24pt\"><span style=\"font-family:wingdings\"></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:微軟正黑體\">恕無法</span><span style=\"font-family:微軟正黑體\">兌</span><span style=\"font-family:微軟正黑體\">換現金</span><span style=\"font-family:微軟正黑體\">或</span><span style=\"font-family:微軟正黑體\">轉讓他人使用</span><span style=\"font-family:微軟正黑體\">。</span></p>\n\n<p style=\"margin-left:24pt\"><span style=\"font-family:wingdings\"></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:微軟正黑體\">恕無法與其他優惠合併使用。</span></p>\n\n<p style=\"margin-left:24pt\"><span style=\"font-family:wingdings\"></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:微軟正黑體\">芬芳美學</span><span style=\"font-family:微軟正黑體\">保留變更</span><span style=\"font-family:微軟正黑體\">、</span><span style=\"font-family:微軟正黑體\">終止及使用辦法之權利，</span><span style=\"font-family:微軟正黑體\">並</span><span style=\"font-family:微軟正黑體\">以網站公告為</span><span style=\"font-family:微軟正黑體\">準</span><span style=\"font-family:微軟正黑體\">。</span></p>\n\n<p><span style=\"font-family:微軟正黑體\">&nbsp;</span></p>\n</div>\n', 0, '1', '6', 'TW', NULL, '2018-09-18 13:13:10');
