INSERT INTO `ckeditor` VALUES(49, NULL, '2018/01/27 Competitiveness Marke', '[Competitive marketing in the digital consumer era Marketing for Competitiveness] Traditional Chinese version,<br />\nA number of translators were led by the Chairman of the Institute, and a new book was held in Taichung Lufu Zhishen Museum.<br />\n<br />\nMarketing competitiveness. Competitive marketing<br />\nMarketing Competitiveness = (PR) (PR)<br />\n<br />\n2018/01/27<br />\nAuthor : Philip Kotler / Hermawan Kartajaya / Hooi Den Huan<br />\nTranslator: Ren Lizhong Review / Luo Shaokang School Reading Lin Tingling, Chen Yanjun, Xu Jialin, Xu Qiuping, Huang Zhesheng, Tian Hanguang, Lin Yuxiang, Fu Guozhang<br />\n<br />\n&nbsp;', 0, '1', '3', 'ENG', '2018-08-16 18:33:33', '2018-08-16 18:33:46');
INSERT INTO `ckeditor` VALUES(50, NULL, '[Fragrance Aesthetics Series - T', 'The first lecture of the Fragrance Aesthetics Series [Taiwan Orchid Salon Lecture] was successfully concluded on September 7, 105, thanks to the participation of all VIPs and guests.<br />\n<br />\nThe China Business Education Development Association today (September 7th) is the Taipei City Mayor&#39;s official residence, the &quot;Fragrance Aesthetics Salon Series - Taiwan Orchid Lecture&quot;, which is based on the Taiwanese orchid as the main axis and the six-level industry. The attendees of the lecture included the honorary chairman of the organizer Chen Houming and the secretary general of Fu Guozhang; the co-organizers represented the chairman of the Lilac Women and Children Care Association Chen Shuzhu, the chairman of Qingshan Orchid Biotechnology Liu Qingshan, the vice president of China International Beauty Association Wu Jiazhen, and the future cultural undertakings. Chairman of the company Fu Heyan, and invited the staff of the Agricultural Production Department Biological Production Group Fang Yidan, Tainan District Agricultural Reformation Wang Shixian, Taitung National Treasure Garden Master Guo Qingde, and Zhongxing University Marketing Department Professor Li Zongru and other distinguished guests.<br />\n<br />\nChen Houming, honorary director, said that the improvement of the overall industry and the formation of a complete industrial value chain will be an opportunity for the future development of Taiwan orchids. &quot;The Taiwan Aunt Lanyu Rehabilitation Project Host&quot; Dr. Luo Shengxian said the story of Taiwan&#39;s native orchids; Chairman Liu Qingshan shared the experience of orchid breeding, cultivation and export; National Health and Beauty Review Dr. Xing Yizhi and Liang Yuqi To explore the natural healing and beauty effects of orchids; Zhou Yinglian, the national flower art referee, demonstrates orchid flower aesthetics.<br />\n<br />\nFragrant Aesthetics Salon FB Fans<br />\n<br />\nOrganizer: China Business Management Education Development Association<br />\nCo-organizers: Lilac Maternal and Child Care Association, Qingshan Orchid Biotechnology Co., Ltd., Aquatic International Co., Ltd., and China International Beauty Association<br />\nOrganizer: Qiancheng Culture Industry Co., Ltd.', 0, '1', '3', 'ENG', '2018-08-16 19:18:47', '2018-08-16 19:18:47');
INSERT INTO `ckeditor` VALUES(51, NULL, 'Fragrance Aesthetics Salon 2017 ', 'The &quot;Fragrance Aesthetics Salon 2017 Fall Lecture&quot; today invites everyone to the Xinxin Plant Factory site. Listen to the wonderful speeches of the two speakers, visit the French restaurant of the advanced technology plant factory and the recycling economy, and let the participants get full. Meet with the winter lectures to explore interesting and in-depth agricultural innovation themes.', 0, '1', '3', 'ENG', '2018-08-16 19:22:32', '2018-08-16 19:22:32');
