INSERT INTO `ckeditor` VALUES(55, NULL, '常見問題', 'Q：如何成為經營會員？<br />\nA：一般會員於本網站完成一次消費，經審核通過(約10~15個工作天)即可成為經營會員。<br />\n&nbsp;<br />\nQ：經營會員是否有時效性？<br />\nA：經審核通過成為經營會員後，非經本人申請退會，會員資格永久有效。<br />\n&nbsp;<br />\nQ：為何消費回饋的紅利點數要等10個工作天才能發放？<br />\nA：因實際發放的紅利回饋點數，須扣除退貨商品後，才會依比例自動加值發放。', 0, '1', '6', 'TW', '2018-09-18 13:25:52', '2018-09-18 13:26:09');
