INSERT INTO `config` VALUES(45, 'service', '會員服務條款\r\n', 'I. Recognition and Acceptance Terms<br />\n(1) When you register as a marketing member or start using this service, you have read, understood and agreed to accept all the contents of these Terms of Service, and fully accept the existing and future derived service items and contents of this service. The operation responsible unit of Chaohuigou has the right to modify or change the content of these Terms of Service at any time. The revised terms of service will be posted on the website. Members are advised to pay attention to such modifications or changes at any time. When the Member continues to use the Service after any modification or change, the Member shall be deemed to have read, understood and agreed to accept such modification or change. If they do not agree with the amendment or update of the above terms of service, or do not accept any other agreement in these terms of service, members shall immediately stop using this service.<br />\n(2) Both the member and the Association agree to use all the contents of the Service, including the expression of intention, etc., with electronic documents as the means of presentation.<br />\n(3) If you are under the age of 20, in addition to meeting the above requirements, you must read, understand and agree to all the contents of this member&#39;s service terms and subsequent changes after your parents (or guardians). Use or continue to use the service. When you use or continue to use the service, it means that your parent (or guardian) has read, understood and agreed to accept all the contents of this member&#39;s terms of service and subsequent amendments. In order to ensure the protection of personal data, privacy and consumer rights of members, the personal data of members will be used in the transaction process, and we will inform the following in accordance with Article 8 of the Personal Data Protection Law: Purpose of collection: Purpose of collection is for marketing Business, consumer, customer management and service, online shopping and other e-commerce services and surveys, statistics and research analysis (statutory specific purpose project numbers are O 40, O 90, 1148, 157). Personal data will be collected through the process of joining members or conducting transactions.', NULL, NULL, 'ENG');
INSERT INTO `config` VALUES(46, 'privacy', '隱私權政策', 'Mengikuti ketentuan &quot;Undang-Undang Perlindungan Data Pribadi&quot;, kami telah merumuskan kebijakan perlindungan privasi. Anda dapat merujuk ke konten kebijakan perlindungan privasi berikut.<br />\nKeamanan data pribadi<br />\nMelindungi privasi pribadi anggota adalah konsep bisnis penting Chaohui. Tanpa persetujuan anggota, kami tidak akan pernah memberikan informasi pribadi anggota kepada pihak ketiga mana pun yang tidak terkait dengan layanan situs web belanja ini. Anggota harus menjaga keamanan kata sandi online dan informasi pribadi mereka, dan tidak memberikan informasi pribadi apa pun, terutama kata sandi online, kepada siapa pun. Setelah menggunakan berbagai fungsi layanan yang disediakan oleh situs web Super Buy, Anda harus ingat untuk keluar dari akun Anda. Jika Anda berbagi komputer dengan orang lain atau menggunakan komputer publik, ingatlah untuk menutup jendela browser.<br />\n2. Pengumpulan, pemrosesan, dan penggunaan data pribadi<br />\nData pribadi yang diperoleh oleh situs web Chaohuigou yang relevan hanya digunakan oleh Chaohuigou dalam penggunaan internalnya dan sesuai dengan tujuan dan ruang lingkup yang disebutkan sebelumnya. Kecuali dinyatakan sebelumnya atau sesuai dengan hukum yang relevan, Chaohuigou tidak akan memberikan informasi kepada orang ketiga, atau untuk tujuan lain.<br />\n&middot; Tujuan pengumpulan:<br />\nTujuan dari pengumpulan ini adalah untuk melakukan bisnis pemasaran, konsumen, manajemen dan layanan pelanggan, belanja online dan layanan e-commerce lainnya dan survei, statistik dan analisis penelitian (nomor proyek tujuan khusus menurut undang-undang adalah 0400, 090, 148, Satu lima tujuh) . SuperPlus akan mengumpulkan informasi pribadi melalui proses bergabung dengan anggota atau melakukan transaksi.<br />\n&middot; Jenis data pribadi yang dikumpulkan:<br />\nInformasi pribadi yang dikumpulkan oleh Chaohuigo di situs web meliputi:<br />\n(1) C001 mengidentifikasi seorang individu: seperti nama anggota, alamat, telepon, email dan informasi lainnya.<br />\n(2) C002 mengidentifikasi orang keuangan: seperti kartu kredit atau informasi akun lembaga keuangan.<br />\n(3) deskripsi pribadi C011: Misalnya: jenis kelamin, tanggal lahir, dll.<br />\n&middot; Gunakan periode, area, objek dan metode:<br />\n(1) Periode: Tanggal di mana anggota yang bersangkutan meminta untuk berhenti menggunakan layanan atau pembelian layanan dihentikan.<br />\n(2) Wilayah: Data pribadi anggota akan digunakan di Taiwan.<br />\n(3) Sasaran dan metode: Pengumpulan data pribadi anggota akan digunakan di samping fungsi manajemen keanggotaan dan pencarian dan penyelidikan manajemen pelanggan untuk pembelian super-manfaat, dan juga akan digunakan untuk identifikasi, layanan aliran emas, layanan logistik, promosi pemasaran, dll. Contohnya adalah sebagai berikut:<br />\nSebuah. Saat menggunakan berbagai layanan yang disediakan oleh Chaohui Shopping sebagai anggota, informasi anggota secara otomatis ditampilkan pada halaman.<br />\nb. Untuk melakukan transaksi: ketika anggota melakukan reservasi, penawaran, pembelian, berpartisipasi dalam hadiah, dll., Atau terlibat dalam transaksi lain untuk barang atau jasa, mereka akan bertanya tentang distribusi barang, penyediaan layanan tenaga kerja, pembayaran premi, balas ke pertanyaan pelanggan, dan manfaat luar biasa. Membeli pertanyaan kepada anggota, layanan purna jual terkait dan layanan lain yang diperlukan untuk Exchange.<br />\nc. Iklan promosi atau pemasaran, dll.: Memberi anggota berbagai majalah elektronik dan informasi lainnya, dan memberikan informasi terkait layanan melalui email, surat, telepon, dll. Personalisasi konten atau iklan yang ditelusuri oleh anggota sesuai dengan atribut atau pembelian pribadi catatan pelanggan, dan riwayat pembelian situs web Superbike, menganalisis penggunaan layanan oleh anggota, mengembangkan layanan baru atau meningkatkan layanan yang ada. Hubungi anggota untuk pendapat, jajak pendapat, acara, papan pesan, dll, atau hal-hal terkait layanan lainnya.<br />\nd. Menanggapi pertanyaan pelanggan: Menanggapi pertanyaan anggota kepada Chaohuigou melalui email, surat, faks, telepon atau metode kontak langsung dan tidak langsung lainnya.<br />\ne. Bisnis lain dengan masalah-masalah insidentil: Penggunaan yang diperlukan untuk menyediakan layanan untuk pembelian super-manfaat yang menyertai tujuan pemanfaatan a hingga d di atas.<br />\nf. Informasi yang disediakan oleh penyedia layanan individual: Ketika anggota melakukan reservasi, penawaran, pembelian, berpartisipasi dalam kegiatan bonus atau mengajukan permohonan transaksi lainnya untuk barang atau jasa penyedia layanan, Guoding berada dalam jangkauan pertukaran yang diperlukan. File data pribadi anggota dapat diberikan kepada penyedia layanan, dan penyedia layanan bertanggung jawab untuk mengelola file data pribadi. Chaohuigou akan memberikan penyedia layanan dengan kewajiban untuk memproses data pribadi sesuai dengan prinsip melindungi privasi anggota sesuai dengan protokol, tetapi tidak ada jaminan bahwa penyedia layanan akan selalu mematuhi. Untuk detailnya, silakan hubungi penyedia layanan masing-masing.<br />\ng. Lainnya: Ketika memberikan layanan individual, data pribadi dapat digunakan untuk tujuan selain yang ditentukan di atas. Pada titik ini, inti dari individu', NULL, NULL, 'IND');
