INSERT INTO `enews` VALUES(166, 45, 'tessst', '1d454c45f44566903115630d1131bccb.jpg', 'tstttttstessettsttsetestestesttseste', 1, 'TW', '1', '2019-07-12 10:31:02', '2019-07-12 10:31:02');
INSERT INTO `enews` VALUES(146, 53, 'The world\'s only non-toxic', 'e6e48d5337b31d0f8f1c8001981736f3.jpg', 'Jasmine tea is a kind of processed tea, which is also often called jasmine scent; jasmine is slightly cool, sweet and spicy, and the &quot;Chinese Dictionary&quot; reads: Jasmine has the effect of &quot;regulating qi, opening sputum and sputum&quot;. Drinking jasmine tea often can relax nerves and relieve tension. In the tea world, jasmine flowers can smell the taste of spring, so there are the famous ten flower teas in the East.<br />\n&nbsp;<br />\nChanghua Flower Altar is the largest jasmine producing area in Taiwan. It is different from traditional farming methods. It uses safe farming method to grow non-toxic jasmine flowers and dry it with low-temperature drying method. It retains the most natural floral flavor of jasmine and becomes the only non-toxic edible jasmine producing area in the world. The aroma is memorized as &quot;the first fragrance in the world.&quot; Persistence in the whole process without using pesticides is the biggest characteristic of jasmine flowers produced by flower beds. The organic jasmine is more ugly in appearance, generally spindle-shaped flower buds. Here, we can see corners from time to time; insect bites, insects eat, people can eat Have peace of mind.<br />\n&nbsp;<br />\nThe organic jasmine planted by the non-toxic agricultural method, the organic control materials are cheaper than the general pesticides, the insect-proof effect is also poor, and the yield per unit area is also reduced. The planting cost is twice that of the general agricultural law; in addition to the tea export, the domestic famous food manufacturers are also Long-term customers of flower bed jasmine.<br />\n<br />\n<br />\n<br />\nPicking jasmine is actually a big project. The process of removing leaves and defective impurities can only rely on pure handwork. The skill of manual sorting determines the quality of the flowers. Otherwise, the impurities are easy to have odors. The picking time is usually determined according to the amount of flowers. Pick it up to 6 o&#39;clock in the evening, because the temperature is too high, it will cause flowering. In order to preserve the unique aroma of the flower when it is being opened, after the flower is taken off, it is necessary to blow cold air when it is too hot.<br />\n<br />\nAt 7:00 and 8:00 pm, the jasmine black tea in the flower bed is different from the general process of making jasmine black tea. It is usually piled on the ground. Here, rice bran is used to pile up layers. The flowers are wet and the tea will naturally heat up. Use the heat to stain the flowers with the tea leaves and let the tea absorb the aroma. In the middle of the night, turn over the pile to avoid overheating.<br />\n<br />\n<br />\n<br />\nThe tea used in making jasmine tea is from alpine tea, oolong, golden carp, bag seed, black tea, and all seasons. Most of them are lightly fermented teas, and the ability to absorb floral scent is strong; ultra-wild black tea is As a result of many attempts, the tea leaves are not bitter and have a throat rhyme, which is the best match with the aroma of jasmine.<br />\n&nbsp;<br />\nHuanong said that because of the long working hours, it is often not sleeping during the production season from May to August; after 16 hours of mixing flowers and tea, it is necessary to separate the flowers from the flower-filled tea leaves before starting baking. Tea, which is mechanically combined with manual treatment, tea leaves should be stuffed and dried. At this time, the water content must be controlled, from 15% to 3-5%. The process of dehydration is often the key to determining the aroma of tea, and the operation can only rely on it. Tea farmers have a sensitive sense of smell; good jasmine tea should be brewed in a glass, the water temperature is 80 to 90 degrees, and the soup of the good tea is yellow and bright. Even if it is brewed more than 5 times, it is still full of flowers.', 0, 'ENG', '1', '2018-08-17 11:13:39', '2018-08-17 11:13:39');
INSERT INTO `enews` VALUES(147, 54, 'Tea bag tea is learned!', 'c8a866481c6656cd6b264757fc0fda16.jpg', 'Hold a cup of good tea, smell the tea and taste the tea.<br />\nFeel the temperature from the palm of your hand, don&#39;t have to pay for the tea set~<br />\n<br />\nA tea bag can make a cup of good tea and keep yourself away from the dust.<br />\nHow to make good tea with tea bags? Just remember the key three steps.........<br />\n<br />\n&sect; Prepare items<br />\n&nbsp; &nbsp; 1. Heat resistant cup 1<br />\n&nbsp; &nbsp; 2. 1 favorite tea bag<br />\n&nbsp; &nbsp; 3. 85 &deg; C hot water 250 ~ 350ml<br />\n<br />\n<br />\n&sect; Steps<br />\n&nbsp; &nbsp; STEP1. Warm cup: Pour into the hot water temperature cup and drain it for 10 seconds.<br />\n&nbsp; &nbsp; STEP2. Tea: Put in a tea bag and heat the water 250~350ml.<br />\n&nbsp; &nbsp; STEP3. Stuffed tea: The cup cover is scented for 3 minutes, and the tea bag is taken out.<br />\n&nbsp;<br />\n<br />\n&sect; Xiaobian notes<br />\nIt is best to use hot cups for ceramics. It is not recommended to use a thermos cup!<br />\nThe taste and taste vary from person to person. You can try all kinds of water and brewing time to find your favorite taste.<br />\n<br />\n&sect; Recommended tea: red oolong tea, honey fragrant black tea, jasmine black tea, burdock frozen top oolong tea, pomelo oolong tea', 0, 'ENG', '1', '2018-08-17 11:29:05', '2018-08-17 11:29:05');
