INSERT INTO `iqr_cart` VALUES(2, '<strong>*貨到付款(宅配)*</strong><br />\r\n將於接獲訂單後的三日內(不包含例假日)利用宅配物流寄出(代收款限新台幣十萬元內)<br />\r\n<br />\r\n<strong>*匯款*</strong><br />\r\n將於收到款項後的7個工作天內，會將商品送達到您所填寫的收件地址。<br />\r\n&nbsp;', '<span style=\"font-size:18px\"><strong>＃付款方式與付款流程</strong></span><br />\r\n<br />\r\n<span style=\"color:rgb(255, 0, 0)\"><strong>ATM轉帳付款</strong></span><br />\r\n<br />\r\n<span style=\"color:#0000CD\"><strong>a.&nbsp;轉帳通知</strong></span><br />\r\n當您選擇轉帳付款，即會收到一封「訂購通知單」通知信，請您至全省實體ATM提款機進行轉帳，或直接透過網路ATM轉帳。<br />\r\n<br />\r\n<span style=\"color:#0000CD\"><strong>b. 匯款通知</strong></span><br />\r\n請您於完成匯款或轉帳手續後登入「會員中心 - 訂單查詢」，於該筆訂單內容的「匯款通知」中輸入您的匯款帳號後五碼與匯款日期，以確保您的權利。<br />\r\n<br />\r\n<span style=\"font-size:18px\"><strong># 運費計算</strong><br />\r\n<span style=\"font-size:14px\">商品運費另計；收到確認的訂單後，客服人員會E-MAIL回覆含運費的總金額及匯款資料，匯款後請回傳您的匯款帳號後5碼，感謝您的配合。</span><br />\r\n<br />\r\n<strong>＃申請退貨說明</strong></span><br />\r\n<br />\r\n<strong><span style=\"color:#0000CD\"><span style=\"background-color:#FFFFFF\">1. 收到貨後的七天內(包含收貨日當天)</span></span></strong><br />\r\n若您買錯商品或想要辦理退貨，請您於收到貨後7天內(包含收貨日當天)，至「會員中心 - 訂單查詢」的訂單內容中申請「<strong>退貨</strong>」，客服專員會於最近的上班日上午9時至下午17時與您聯繫，並與您約定取貨細節。<br />\r\n<br />\r\n<span style=\"color:#0000CD\"><strong>2. 全新狀態且完整包裝</strong></span><br />\r\n請注意，退貨的商品必須為全新狀態且完整包裝（包含贈品等）。<br />\r\n但前述商品如有新品瑕疵問題，仍可享無條件退換貨的售後服務。<br />\r\n<br />\r\n<span style=\"color:#0000CD\"><strong>3. 需自行負擔退貨運費</strong></span><br />\r\n7天鑑賞期過後，若非新品瑕疵造成退貨，我們將不負擔此退貨所衍生的運送費用，此運送費用會於退款中直接相扣抵。<br />\r\n<br />\r\n<strong><span style=\"color:#0000CD\">4. 發票相關問題</span></strong><br />\r\n除需打統編/抬頭的三聯式發票外，您所有的發票及交易紀錄都記錄在您的帳戶資訊裡，如需退貨可依據退貨指示進行相關作業；由於發票已託管於本公司，故在進行退貨時本公司會一併將該發票註銷，省去您掛號寄回的麻煩。若是選擇打 統編 / 抬頭的三聯式發票，請於收到發票後，將發票（或折讓單簽名）以掛號寄回，我們將於收到退貨商品及發票並確認無誤後，於7~10個工作天內(不包含例假日，退款入帳天數需依照各大刷卡銀行操作時間為主)退款給您。<br />\r\n<br />\r\n<span style=\"font-size:18px\"><strong>#取消訂單說明</strong></span><br />\r\n<br />\r\n&nbsp;您可以透過下列<strong>兩種</strong>方式來取消訂單：<br />\r\n1. 您可以利用「會員中心 - 訂單查詢」中的申請退貨功能辦理退貨取消訂單作業，客服專員會儘速跟您聯繫。<br />\r\n<br />\r\n2. 也歡迎親電產品諮詢專線，客服專員會竭誠為您處理訂單取消事宜。', '* Cash On Delivery (Home Delivery) *<br />\nIt will be sent by home delivery logistics within three days (excluding regular holidays) after receiving the order (the collection fee is limited to NT $ 100,000)<br />\n*money transfer*<br />\nThe goods will be delivered to the address you filled in within 7 working days after receiving the payment.', '#payment method and payment process', '*貨到付款(宅配)*<br />\n將於接獲訂單後的三日內(不包含例假日)利用宅配物流寄出(代收款限新台幣十萬元內)<br />\n<br />\n*匯款*<br />\n將於收到款項後的7個工作天內，會將商品送達到您所填寫的收件地址。', '# Metode pembayaran dan proses pembayaran<br />\nPembayaran transfer ATM<br />\nPemberitahuan transfer<br />\nKetika Anda memilih untuk mentransfer pembayaran, Anda akan menerima surat pemberitahuan &quot;Pemberitahuan Pemesanan&quot;, silakan pergi ke mesin ATM tunai fisik di provinsi untuk melakukan transfer, atau langsung mentransfer uang melalui ATM online.<br />\nb. Pemberitahuan pengiriman uang<br />\nSilakan masuk ke &quot;Permintaan Anggota Pusat-Pesanan&quot; setelah menyelesaikan prosedur pengiriman uang atau transfer, dan masukkan lima digit nomor akun pengiriman uang Anda dan tanggal pengiriman uang dalam &quot;Pemberitahuan Pengiriman Uang&quot; dari konten pesanan untuk memastikan hak-hak Anda.<br />\n# Perhitungan pengiriman<br />\nPengangkutan komoditas bersifat ekstra; setelah menerima pesanan yang telah dikonfirmasi, staf layanan pelanggan akan membalas E-MAIL jumlah total termasuk pengiriman dan informasi pengiriman uang. Setelah pengiriman uang, silakan kirim kembali 5 digit dari rekening pengiriman uang Anda, terima kasih atas kerja sama Anda.<br />\n#Aplikasi untuk instruksi pengembalian<br />\n1. Dalam tujuh hari setelah menerima barang (termasuk hari penerimaan)<br />\nJika Anda membeli produk yang salah atau ingin mengembalikannya, silakan ajukan &quot;pengembalian&quot; dalam konten pesanan &quot;Permintaan Anggota Pusat-Pesanan&quot; dalam waktu 7 hari (termasuk hari penerimaan), dan spesialis layanan pelanggan akan Kami akan menghubungi Anda mulai jam 9 pagi hingga 17 sore pada hari kerja terdekat dan setuju dengan Anda detail pengambilan.<br />\n2. Kondisi baru dan kemasan lengkap<br />\nHarap dicatat bahwa barang yang dikembalikan harus benar-benar baru dan benar-benar dikemas (termasuk hadiah, dll.).<br />\nNamun, jika produk tersebut memiliki cacat produk baru, mereka masih dapat menikmati layanan pengembalian tanpa syarat.<br />\n3. Anda harus menanggung sendiri biaya pengiriman kembali<br />\nSetelah periode apresiasi 7 hari, jika pengembalian tidak disebabkan oleh cacat pada produk baru, kami tidak akan bertanggung jawab atas biaya pengiriman yang berasal dari pengembalian, dan biaya pengiriman ini akan langsung dikurangkan dari pengembalian uang.<br />\n4. Masalah terkait faktur<br />\nSemua faktur dan catatan transaksi dicatat dalam informasi akun Anda, kecuali untuk faktur rangkap tiga yang perlu dikompilasi / dituju. Jika Anda perlu mengembalikan barang, Anda dapat melakukan operasi terkait sesuai dengan instruksi pengembalian. Karena faktur telah di-host oleh perusahaan, Perusahaan akan membatalkan faktur ketika mengembalikan barang, menghilangkan kesulitan mengirim Anda melalui surat terdaftar. Jika Anda memilih untuk mencetak faktur tiga dengan unified / header, harap kembalikan faktur (atau tanda tangan slip konsesi) melalui surat terdaftar setelah menerima faktur. Kami akan menerima barang yang dikembalikan dan faktur dan mengkonfirmasi bahwa itu benar. Pengembalian uang kepada Anda dalam waktu 10 hari kerja (tidak termasuk hari libur, jumlah hari di mana pengembalian uang akan dikreditkan didasarkan pada waktu operasi bank kartu kredit utama).<br />\nDeskripsi pesanan #Cancel<br />\n&nbsp;Anda dapat membatalkan pesanan Anda dengan dua cara:<br />\n1. Anda dapat menggunakan fungsi &quot;Permintaan Pengembalian&quot; di &quot;Permintaan Anggota Pusat-Pesanan&quot; untuk memproses pembatalan pengembalian pesanan. Spesialis layanan pelanggan akan menghubungi Anda sesegera mungkin.<br />\n2. Selamat datang di hotline konsultasi produk pro-listrik, spesialis layanan pelanggan akan dengan senang hati menangani pembatalan pesanan Anda.', NULL, NULL, NULL, NULL, 1, 0, 1, NULL, 'service@supergoods.com.tw', '超惠購', '台中市北屯區東山路一段50-18號', '0424351860', '', '0424351862', '1', 1, 'TW');
