INSERT INTO `photo_type` VALUES(10, 0, 'Theme lecture', '&quot;2018 Fragrant Aesthetics Salon Lecture - Eastern Field&quot;<br />\n2017/11/4<br />\n<br />\nThe &quot;Fragrance Aesthetics Salon&quot; came to the beautiful Taitung City on March 9th. The speakers shared the development of Taitung rice, tea and coffee industry since the Japanese rule, and discussed the innovation of Taitung&#39;s refined agricultural products and the international trend. Feasible path.<br />\nThanks to the Taitung Agricultural Improvement Field, the Tea Industry Improvement Field, and Taitung College for their support of this event. Thanks: Jiang Rui Gong, former deputy director, Wu Shengyu, and Cai Zhixian, the director gave a wonderful and in-depth speech. Thanks: Miguo School, Electro-optical Community Development Association, and Linwang Tea Factory for the combination of exquisite agriculture and culture.<br />\n<br />\nThe second &quot;Fragrance Aesthetics Salon&quot; in 2018 was held in Singapore in June, so stay tuned! ⋯⋯', 'Y', '2018-08-16 19:36:11', '2018-08-16 19:37:22', 'ENG');
