INSERT INTO `products` VALUES(174, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '草本牙膏', 'p955a140136d6fb312c9b44cf6e9a1759.jpg,pd3a3c315ba7e706fbbc7e068db744891.jpg', '', '', '', '6.00', '6.00', '6.00', '*#生產地：*#製造地：*#容量：*#包裝尺寸：', '*#泰國 *#泰國 *#160g*#17.8*4.5*4.5cm', '9940', '', 20, '', '每天都要刷牙都用使用到的牙膏，你有注意過他的成分是否天然呢？<br />\n來自泰國，由洋甘菊、薄荷葉與丁香等天然植物提煉製成的草本牙膏。<br />\n讓您安心使用，天然草本配方，更有效維持好口氣。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180817085353_796eb.jpg&quot; /><br />\n擠出豆粒大小量的牙膏於牙刷上。<br />\n每天早晚使用，有助於保持牙齦和牙齒健康。<br />\n美好的一天從天然草本牙膏開始！<br />\n用法：依照正常刷牙方式，每天最少2次<br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180817085353_50a40.jpg&quot; />', '', '', 39, NULL, 1.2, 0, 0, 0, 'IND', 'Y', '2018-01-12 18:21:31', '2019-08-06 10:12:46', 2, 0, 'set_d923f0c855bab0bcff5960e1f472c4b1.jpg', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(173, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '乾燥花香氛四入特惠組', 'pc626090d1abdef776c59fab8b6c1aff1.jpg,p41e0addf3eceb74f62979d00d1a817f2.jpg', '', '', '', '53.00', '53.00', '53.00', '', '', '20', '', 10, '', '來自泰國的天然乾燥香氛系列。<br />\n茶樹、薰衣草、玫瑰、蕨葉，四款香氛一次擁有。<br />\n適合使用在居家、辦公室內，為生活空間添增清新香味。<br />\n<br />\n味道清新、簡單，不複雜的香氛小物。<br />\n可以依個人喜好選擇不同的組合，給生活空間帶來不同感受。<br />\n<br />\n生產地：泰國<br />\n製造地：泰國<br />\n容量：85ml*4瓶<br />\n包裝尺寸：19.4*15.5*5cm<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180817152715_232a6.jpg&quot; />', '', '', 39, NULL, 10.6, 0, 0, 0, 'TW', 'Y', '2018-01-12 18:20:56', '2019-07-24 19:16:24', 23, 1, 'set_f29d87490e2ecc7a113f82441d897b28.png', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
