INSERT INTO `products` VALUES(169, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, NULL, NULL, '乾燥花香氛-茶樹', 'pa2a302916b43538faf9ecae7f6391d19.jpg', '', '', '', '13.00', '13.00', '13.00', '*#生產地：*#製造地：*#容量：*#重量(含包裝)：*#包裝尺寸：', '*#泰國 *#泰國 *#85ml*#210g*#15*4.5*4.5cm', '1', '', 10, '', '來自泰國的天然乾燥香氛-茶樹。<br />\n適合使用在居家、辦公室內，為生活空間添增清新香味。<br />\n<br />\n味道清新、簡單，不複雜的香氛小物。<br />\n可以依個人喜好選擇不同的香味，給生活空間帶來不同感受。<br />\n<br />\n生產地：泰國<br />\n製造地：泰國<br />\n容量：85ml<br />\n重量(含包裝)：210g<br />\n包裝尺寸：15*4.5*4.5cm<br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180816173828_a11c9.jpg&quot; />', '', '', 39, NULL, 2.6, 0, 0, 0, 'TW', 'Y', '2018-01-12 18:18:58', '2018-08-17 15:24:56', 6, 5, 'set_04b15b94272770d542aa37c24870288f.png', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
