INSERT INTO `products` VALUES(204, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, NULL, NULL, '可愛茶香大象抱枕(大)', 'p55c48c60e2526b8c8b6251943f74ef06.jpg', '', '', '', '500.00', '500.00', '400.00', '', '', '19', '', 10, '', '來自泰國的可愛大象抱枕。<br />\n小巧可愛且不占空間，柔軟棉花舒適又輕盈。<br />\n最不同的地方是，擁有獨特的茶香氣味~~<br />\n精細的縫線技巧，穩固且不易脫落。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180801102256_daa80.jpg&quot; /><br />\n顏色：藏青/藍/白/咖啡/灰/黃金綠/青銅綠/紫<br />\n點點-紫/點點-粉紅/點點-紅', '', '', 36, NULL, 15.0, 0, 0, 0, 'TW', 'N', '2018-08-01 11:10:33', '2018-08-01 11:17:01', 160, 0, 'set_55c48c60e2526b8c8b6251943f74ef06.jpg', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(167, 'fa fa-heart-o', 'N', 'Y', 2, 0, 1, 'N', 'N', 1, NULL, NULL, '五彩有機花草茶 - 茱莉亞藍玫瑰', 'pd5d2c3b976240b998e195d87d0d73c6e.jpg', '*#這世上的花花草草都是大自然的恩賜，擁有著不可思議的神奇自然能量~*#花草茶不僅適用在日常保健、還有養顏美容，放鬆身心的效果。*#鮮豔繽紛的茶色來自台灣天然有機的花草調和而成，絕不添加香精、色素等化學成分。*#飲茶入口時的甜味來自甜菊成分的天然提味，低熱量零負擔，讓您隨時都能享用。*#無添加咖啡因，怕喝茶睡不著的你可以放心飲用~', '', '', '15.00', '13.00', '13.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方法：', '*#2g*10入*#台灣*#台灣*#茱莉亞薄荷 花蓮 蝶豆花、南投埔里 玫瑰天竺葵、雲林 甜菊*#三年*#置於陰涼乾燥處，避免陽光照射。', '1', '', 10, '', '<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144714_00371.jpg&quot; /><br />\n<strong>湛藍知性解靈性</strong><br />\n湛藍的茶色是茱莉亞薄荷與蝶豆花的天然原色，喝著手中的茶飲，就像直接溝通了紊亂的知性與不安的靈性，輝映著遼闊的藍天，煩躁豁然開朗。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144721_78fab.jpg&quot; /><br />\n<strong>舒心自在飲開懷</strong><br />\n茶飲的風味芬芳微甜，啜飲間滲露出類似玫瑰般縈繞的香氛，讓人感到無比舒心平靜，惡魔的鬱悶轉瞬間變成了天使的遐想。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144723_2790a.jpg&quot; /><br />\n<strong>寧神靜氣解百憂</strong><br />\n特別推薦給想要心情平靜、需要思考、或與人商議時來上一杯！<br />\n如同奔向大海般心曠神怡，不知不覺煩惱竟迎刃而解。<br />\n<br />\n<strong>來自台灣精選的有機原料，給您最天然的花草茶。</strong><br />\n走訪各縣市花草與香草的發源地，尋找著天然有機能真正帶給消費者健康的原料。<br />\n嚴格篩選各式療癒效果的花草，經由調配後產出一系列色澤動人又可口的花草茶。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144725_48b94.jpg&quot; /><br />\n<strong>茱莉亞藍玫瑰原料</strong><br />\n選用雲林-茱莉亞薄荷、花蓮-蝶豆花、南投埔里-玫瑰天竺葵、雲林-甜菊。<br />\n安心嚴選的天然有機原料，精選台灣各地有機花草與香草，調配出天然健康的茶飲。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144725_48b94.jpg&quot; /><br />\n<strong>無含添加物、無香精、無色素</strong><br />\n絕無添加色素、香精等化學成分，鮮豔動人的色澤來自天然原料的調配而成。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144727_386c7.jpg&quot; /><br />\n<strong>無咖啡因、低熱量</strong><br />\n不添加咖啡因成分，睡前飲用不會睡不著，而是能夠放鬆身心，有助入眠。<br />\n來自甜菊的天然提味。低熱量的酸甜滋味，讓你不必擔心身材走樣的盡情品味。<br />\n<br />\n<strong>久泡不苦澀、冷熱沖泡有不同口感</strong><br />\n與一般茶款不同。就算泡著一整天，也不會讓你有茶變得苦澀或走味的感覺。<br />\n冷泡、熱泡會有不同口感？！驚艷口感，絕對顛覆你對花草茶的想像。', '', '', 33, NULL, 2.6, 0, 0, 0, 'TW', 'Y', '2018-01-12 18:16:20', '2018-08-15 13:15:28', 1, 3, 'set_d5d2c3b976240b998e195d87d0d73c6e.jpg', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(166, 'fa fa-heart', 'N', 'Y', 0, 0, 1, 'N', 'N', 1, '111111', NULL, '五彩有機花草茶 - 洛神玫瑰', 'p9f52f63b72fe7f0ef8f4a16d3a5841d5.jpg,pea1d192ddea22d64e74bda2ff492b3f8.jpg,pea1bc822ccf5f321c51b528339006ece.jpg', '*#這世上的花花草草都是大自然的恩賜，擁有著不可思議的神奇自然能量~*#花草茶不僅適用在日常保健、還有養顏美容，放鬆身心的效果。*#鮮豔繽紛的茶色來自台灣天然有機的花草調和而成，絕不添加香精、色素等化學成分。*#飲茶入口時的甜味來自甜菊成分的天然提味，低熱量零負擔，讓您隨時都能享用。*#無添加咖啡因，怕喝茶睡不著的你可以放心飲用~', '', '', '15.00', '13.00', '13.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方法：', '*#2g*10入*#台灣*#台灣*#台東 洛神、雲林 甜菊、南投埔里 玫瑰天竺葵*#三年*#置於陰涼乾燥處，避免陽光照射。', '5', '', 5, '', '<br />\r\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808142832_8faa4.jpg&quot; /><br />\r\n<strong>色艷通紅增能量</strong><br />\r\n艷紅的茶色是洛神花的天然色澤，藉由視覺的凝視，彷彿一股暖流注入般增強了身體的正能量，一口口飲入全然的自我、全然的自信，充滿了人生正向的勇氣與對未來美好的憧憬。<br />\r\n<br />\r\n<strong>濃郁酸甜好滋味</strong><br />\r\n精選上品洛神花－入口帶微酸而順喉、酸後帶微甜，玫瑰天竺葵-入口溫潤、香氣內斂。<br />\r\n每一口就像享受著愛情般微酸微甜的美好，人生就該是這種美好的感覺。<br />\r\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808142832_41f3f.jpg&quot; /><br />\r\n<br />\r\n<strong>放鬆舒壓助好眠</strong><br />\r\n來杯洛神玫瑰花茶來告別疲憊的一天吧！全有機天然無咖咖啡因成分，搭配洛神花與玫瑰花特有的口感與清香氣息，讓心靈與身體皆獲得解放，舒緩一天緊繃的情緒，甜甜的進入夢鄉。<br />\r\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808142833_b3c9e.jpg&quot; /><br />\r\n<br />\r\n<strong>來自台灣精選的有機原料，給您最天然的花草茶。</strong><br />\r\n走訪各縣市花草與香草的發源地，尋找著天然有機能真正帶給消費者健康的原料。<br />\r\n嚴格篩選各式療癒效果的花草，經由調配後產出一系列色澤動人又可口的花草茶。<br />\r\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808142834_d7ddf.jpg&quot; /><br />\r\n<strong>洛神玫瑰茶原料</strong><br />\r\n選用台東/洛神花、南投埔里/玫瑰天竺葵、雲林/甜菊。<br />\r\n安心嚴選的天然有機原料，精選台灣各地有機花草與香草，調配出天然健康的茶飲。<br />\r\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808142834_65336.jpg&quot; /><br />\r\n<br />\r\n<strong>無含添加物、無香精、無色素</strong><br />\r\n絕無添加色素、香精等化學成分，鮮豔動人的色澤來自天然原料的調配而成。<br />\r\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808142835_85ce0.jpg&quot; /><br />\r\n<strong>無咖啡因、低熱量</strong><br />\r\n不添加咖啡因成分，睡前飲用不會睡不著，而是能夠放鬆身心，有助入眠。<br />\r\n來自甜菊的天然提味。低熱量的酸甜滋味，讓你不必擔心身材走樣的盡情品味。<br />\r\n<br />\r\n<strong>久泡不苦澀、冷熱沖泡有不同口感</strong><br />\r\n與一般茶款不同。就算泡著一整天，也不會讓你有茶變得苦澀或走味的感覺。<br />\r\n冷泡、熱泡會有不同口感？！驚艷口感，絕對顛覆你對花草茶的想像。', '', '', 33, NULL, 2.6, 0, 0, 0, 'TW', 'Y', '2018-01-12 18:15:44', '2019-07-19 16:15:03', 1, 0, 'set_594429e5af526d9449dab5625656939d.jpg,set_1efa5b0dd4128a088ac4dc86696cd0ca.jpg,set_663dfedb25ec5c2e9531fadcba6ad833.jpg', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(165, 'fa fa-heart', 'Y', 'Y', 3, 2, 1, 'N', 'N', 1, '', NULL, '五彩有機花草茶 - 檸檬瑪利格', 'pe96fbf2a1ba87217a90f7fa831ed8299.jpg,pa322a742947baed72bab3751981e2ddc.jpg,pd8fa0115972286ee8054290bc4bc79d8.jpg', '*#*此為預購商品，商品出貨日為2019/4/1*#這世上的花花草草都是大自然的恩賜，擁有著不可思議的神奇自然能量~*#花草茶不僅適用在日常保健、還有養顏美容，放鬆身心的效果。*#鮮豔繽紛的茶色來自台灣天然有機的花草調和而成，絕不添加香精、色素等化學成分。*#飲茶入口時的甜味來自甜菊成分的天然提味，低熱量零負擔，讓您隨時都能享用。*#無添加咖啡因，怕喝茶睡不著的你可以放心飲用~', '', '', '15.00', '13.00', '13.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方式：', '*#2g*10入*#台灣*#台灣*#花蓮 蝶豆花、屏東 芳香萬壽菊、雲林 檸檬草、雲林 甜菊*#三年*#置於陰涼乾燥處，避免陽光照射。', '-1', '', 10, '', '<strong>綠意盎然富活力</strong><br />\n翠綠色的茶色是檸檬草的原色，輔以芳香萬壽菊、蝶豆花等花草調合，色澤更顯豐富層次，印入眼簾的綠色元素彷彿活絡身體每個細胞、療癒所有的倦怠。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808094733_030e9.jpg&quot; /><br />\n<br />\n<strong>清新甘甜醒元氣</strong><br />\n清新甘甜的口感帶著悠悠的果香與檸檬香，喝下的瞬間好似在綠色草原間如沐春風，精疲力竭感覺一掃而空，元氣滿滿。<br />\n<br />\n<br />\n<strong>光合生機樂悠活</strong><br />\n一大早就來杯有機檸檬瑪麗格樂活你的人生吧！<br />\n就像綠色植物對陽光行光合作用般，獲得滿滿活力，精神奕奕再面對挑戰！<br />\n<br />\n<strong>來自台灣精選的有機原料，給您最天然的花草茶。</strong><br />\n走訪各縣市花草與香草的發源地，尋找著天然有機能真正帶給消費者健康的原料。<br />\n嚴格篩選各式療癒效果的花草，經由調配後產出一系列色澤動人又可口的花草茶。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808094734_3acb1.jpg&quot; /><br />\n<br />\n<strong>檸檬瑪利格原料</strong><br />\n選用屏東-芳香萬壽菊、花蓮-蝶豆花、雲林-甜菊 檸檬草。<br />\n安心嚴選的天然有機原料，精選台灣各地有機花草與香草，調配出天然健康的茶飲。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808094735_baa07.jpg&quot; /><br />\n<br />\n<strong>無含添加物、無香精、無色素</strong><br />\n絕無添加色素、香精等化學成分，鮮豔動人的色澤來自天然原料的調配而成。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808094735_af657.jpg&quot; /><br />\n<strong>無咖啡因、低熱量</strong><br />\n不添加咖啡因成分，睡前飲用不會睡不著，而是能夠放鬆身心，有助入眠。<br />\n來自甜菊的天然提味。低熱量的酸甜滋味，讓你不必擔心身材走樣的盡情品味。<br />\n<br />\n<strong>久泡不苦澀、冷熱沖泡有不同口感</strong><br />\n與一般茶款不同。就算泡著一整天，也不會讓你有茶變得苦澀或走味的感覺。<br />\n冷泡、熱泡會有不同口感？！驚艷口感，絕對顛覆你對花草茶的想像。', '', '', 33, NULL, 2.6, 1, 0, 0, 'TW', 'Y', '2018-01-12 18:14:06', '2019-02-26 16:24:27', 1, 2, 'set_e96fbf2a1ba87217a90f7fa831ed8299.jpg,set_a322a742947baed72bab3751981e2ddc.jpg,set_d8fa0115972286ee8054290bc4bc79d8.jpg', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(164, 'fa fa-heart', 'Y', 'Y', 4, 1, 1, 'N', 'N', 1, '', NULL, '五彩有機花草茶 - 馬鞭紫羅蘭', 'p8274002e01dbb93230b3c1984ac4bff3.jpg,pe9a412161c2474c1d0f6d7d8bd065c7d.jpg,pd4fb0a1b30d91e99a8eebb3aeda422f4.jpg', '*#這世上的花花草草都是大自然的恩賜，擁有著不可思議的神奇自然能量~*#花草茶不僅適用在日常保健、還有養顏美容，放鬆身心的效果。*#鮮豔繽紛的茶色來自台灣天然有機的花草調和而成，絕不添加香精、色素等化學成分。*#飲茶入口時的甜味來自甜菊成分的天然提味，低熱量零負擔，讓您隨時都能享用。*#無添加咖啡因，怕喝茶睡不著的你可以放心飲用~', '', '', '15.00', '5.00', '13.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方法：', '*#2g*10入*#台灣*#台灣*#雲林 紫羅蘭、雲林 甜菊、雲林 檸檬草、雲林 迷迭香 、屏東 檸檬馬鞭草*#三年*#置於陰涼乾燥處，避免陽光照射。', '0', '', 999, '', '<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180807171822_fc5a7.jpg&quot; /><br />\n<strong>神秘紫氣女神風範</strong><br />\n紫色是紫羅蘭花的天然原色，由於紫色的光波最短，在自然界中較少見到，向來被引申為象徵高貴與神秘，手捧一杯富麗的紫色花草茶，透露出女神般神秘具魅惑的氣質。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808093258_e7f5a.jpg&quot; /><br />\n<br />\n<strong>皇家氣味滿芬芳</strong><br />\n特選有機紫羅蘭、檸檬草、馬鞭草及迷迭香等花草，飲用時口口微酸甜並伴隨撲鼻而來的滿滿花香，感覺猶如置身皇家宮廷，高貴而富有氣質。<br />\n<br />\n<strong>簡單輕盈舒身心</strong><br />\n長時間久坐久站的你，快來杯馬鞭紫羅蘭茶飲放鬆一下。<br />\n舒緩你的身體與心理~微妙滋味帶給你美好的每一天。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808093259_42db0.jpg&quot; /><br />\n<br />\n<strong>來自台灣精選的有機原料，給您最天然的花草茶。</strong><br />\n走訪各縣市花草與香草的發源地，尋找著天然有機能真正帶給消費者健康的原料。<br />\n嚴格篩選各式療癒效果的花草，經由調配後產出一系列色澤動人又可口的花草茶。<br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808093259_99db0.jpg&quot; /><br />\n<br />\n<strong>馬鞭紫羅蘭原料</strong><br />\n選用雲林 紫羅蘭、雲林 甜菊、雲林 檸檬草、雲林 迷迭香 、屏東 檸檬馬鞭草 。<br />\n安心嚴選的天然有機原料，精選台灣各地有機花草與香草，調配出天然健康的茶飲。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808093300_5f5e2.jpg&quot; /><br />\n<strong>無含添加物、無香精、無色素</strong><br />\n絕無添加色素、香精等化學成分，鮮豔動人的色澤來自天然原料的調配而成。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808093300_da671.jpg&quot; /><br />\n<br />\n<strong>無咖啡因、低熱量</strong><br />\n不添加咖啡因成分，睡前飲用不會睡不著，而是能夠放鬆身心，有助入眠。<br />\n來自甜菊的天然提味。低熱量的酸甜滋味，讓你不必擔心身材走樣的盡情品味。<br />\n<br />\n<strong>久泡不苦澀、冷熱沖泡有不同口感</strong><br />\n與一般茶款不同。就算泡著一整天，也不會讓你有茶變得苦澀或走味的感覺。<br />\n冷泡、熱泡會有不同口感？！驚艷口感，絕對顛覆你對花草茶的想像。', '', '', 33, NULL, 2.6, 2, 0, 0, 'TW', 'Y', '2018-01-12 18:12:34', '2019-03-05 15:37:55', 1, 4, 'set_8274002e01dbb93230b3c1984ac4bff3.jpg,set_e9a412161c2474c1d0f6d7d8bd065c7d.jpg,set_d4fb0a1b30d91e99a8eebb3aeda422f4.jpg', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(163, 'fa fa-heart-o', 'Y', 'Y', 1, 0, 1, 'N', 'N', 1, '123456', NULL, '五彩有機花草茶 - 蕎麥龍眼花', 'p08ace85b37ee4ef51f17722fb70c847d.jpg,p9c01e4e8e9febb06a16c1d197479d852.jpg,p4157bab18d41a443d5d4dd178dad121d.jpg', '*#這世上的花花草草都是大自然的恩賜，擁有著不可思議的神奇自然能量~*#花草茶不僅適用在日常保健、還有養顏美容，放鬆身心的效果。*#鮮豔繽紛的茶色來自台灣天然有機的花草調和而成，絕不添加香精、色素等化學成分。*#飲茶入口時的甜味來自甜菊成分的天然提味，低熱量零負擔，讓您隨時都能享用。*#無添加咖啡因，怕喝茶睡不著的你可以放心飲用~', '', '', '15.00', '5.00', '13.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方法：', '*#2g*10入*#台灣*#台灣*#台南林二 黃金蕎麥、雲林 甜菊、雲林 七葉膽、雲林 七葉蘭、雲林土庫 龍眼花*#三年*#置於陰涼乾燥處，避免陽光照射。', '1', '', 10, '', '<strong><img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144349_519db.jpg&quot; /><br />\n清新明亮如湧泉</strong><br />\n亮黃色的茶色是黃金蕎麥、龍眼花、七葉蘭等天然成分融合而成的原色，<br />\n明亮清新的黃色立即帶來源源不絕的活力感，如同湧泉般川流不息。<br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144350_43c2d.jpg&quot; /><br />\n<strong>甜水淡雅立回甘</strong><br />\n初嘗蕎麥龍眼花茶飲的味道即是甜水淡雅，然而後味回甘強烈，一解身體的乾渴，<br />\n每一口回甘回甘再回甘，體嚐禪學領域般的人生百味雋永不息。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144350_31921.jpg&quot; /><br />\n<strong>細水長流保活力</strong><br />\n隨時來杯有機天然蕎麥龍眼花茶回饋你渴望的人生吧！<br />\n人生的渴望何其多，細水長流才能常保活力，回甘的人生才值得一再的品嘗。<br />\n<br />\n<strong>來自台灣精選的有機原料，給您最天然的花草茶。</strong><br />\n走訪各縣市花草與香草的發源地，尋找著天然有機能真正帶給消費者健康的原料。<br />\n嚴格篩選各式療癒效果的花草，經由調配後產出一系列色澤動人又可口的花草茶。<br />\n<br />\n<br />\n<strong>蕎麥龍眼花茶原料</strong><br />\n選用台南二林-黃金蕎麥、雲林土庫-龍眼花、雲林-甜菊 七葉膽 七葉蘭。<br />\n安心嚴選的天然有機原料，精選台灣各地有機花草與香草，調配出天然健康的茶飲。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144351_2e987.jpg&quot; /><br />\n<br />\n<strong>無含添加物、無香精、無色素</strong><br />\n絕無添加色素、香精等化學成分，鮮豔動人的色澤來自天然原料的調配而成。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144351_810c2.jpg&quot; /><br />\n<strong>無咖啡因、低熱量</strong><br />\n不添加咖啡因成分，睡前飲用不會睡不著，而是能夠放鬆身心，有助入眠。<br />\n來自甜菊的天然提味。低熱量的酸甜滋味，讓你不必擔心身材走樣的盡情品味。<br />\n<br />\n<strong>久泡不苦澀、冷熱沖泡有不同口感</strong><br />\n與一般茶款不同。就算泡著一整天，也不會讓你有茶變得苦澀或走味的感覺。<br />\n冷泡、熱泡會有不同口感？！驚艷口感，絕對顛覆你對花草茶的想像。', '', '', 33, NULL, 0.0, 0, 0, 0, 'TW', 'Y', '2018-01-12 18:04:05', '2019-08-05 13:19:11', 1, 1, 'set_08ace85b37ee4ef51f17722fb70c847d.jpg,set_9c01e4e8e9febb06a16c1d197479d852.jpg,set_4157bab18d41a443d5d4dd178dad121d.jpg', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
