INSERT INTO `products` VALUES(177, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '乾燥花畫(大)', 'pd9066460e11c7622c91c1546751f510f.jpg,p6072d1982721d7d427dc3949642bcbb3.jpg', '', '', '', '61.00', '61.00', '61.00', '*#生產地：*#製造地：*#尺寸：', '*#泰國 *#泰國 *#(大)29*24cm', '15', '', 10, '', '多款來自泰國的手工乾燥花畫，永不凋謝，易於保存不需照顧。<br />\n適合裝飾居家、辦公空間，為室內增添藝術氣息，展現生活態度。<br />\n<br />\n乾燥花是簡單、小巧又美麗的展示小品。<br />\n而不同的組合，可以帶出不一樣的層次感。<br />\n<br />\n小巧而簡單的居家裝飾，也適合作為禮物送給重要的人。<br />\n無論是放置在桌上、或是掛在牆面上都是很美的一片風景。<br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180817090935_14fe2.jpg&quot; /><br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180817164313_34894.jpg&quot; /><br />\n<br />\n每幅畫圖案略有不同，深色框、淺色框，採隨機出貨。<br />\n畫框背面有支撐架，可直接立於桌面。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180817090936_7441a.jpg&quot; /><br />\n<br />\n<br />\n&nbsp;', '', '', 39, NULL, 12.2, 0, 0, 0, 'TW', 'Y', '2018-01-12 18:23:27', '2019-07-22 17:08:11', 16, 6, 'set_dedf828deebbfd4fb5b7386a1f96a578.png', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
