INSERT INTO `products` VALUES(217, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '草本牙膏', 'pf64f754fad36c495fc708493bd015fa6.jpg,p1c457837bb320a4427cd635d78e03e5f.jpg', '', '', '', '6.00', '6.00', '6.00', '*#生產地：*#製造地：*#容量：*#包裝尺寸：', '*#泰國 *#泰國 *#160g*#17.8*4.5*4.5cm', '0', '', 10, '', '每天都要刷牙都用使用到的牙膏，你有注意過他的成分是否天然呢？<br />\n來自泰國，由許多天然植物，洋甘菊、薄荷葉與丁香等提煉製成的草本牙膏。<br />\n讓您安心使用，天然草本配方，更有效維持好口氣。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180817085353_796eb.jpg&quot; /><br />\n擠出豆粒大小量的牙膏於牙刷上。<br />\n每天早晚使用，有助於保持牙齦和牙齒健康。<br />\n美好的一天從天然草本牙膏開始！<br />\n用法：依照正常刷牙方式，每天最少2次<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180817085353_50a40.jpg&quot; />', '', '', 24, NULL, 1.2, 0, 0, 0, 'TW', 'Y', '2018-08-02 17:13:49', '2018-11-09 17:22:26', 2, 0, 'set_50a08a722c1864f4bfc35215610dc115.jpg', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
