INSERT INTO `products` VALUES(222, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '【馬鞭紫羅蘭】養顏/三神八福系列', 'pe283f300aa07de33046173df3a751668.jpg,pd720f4652b2b86b935eaf612dc131488.jpg,p22af72210c5b65bd8c3d66fdcfddb347.jpg', '*#【養顏-保持青春容貌，補充一天好心情。】*# 我們聽見您講究品質的聲音，我們看見您想要獨創一格的新興茶品。*#來自台灣的嚴選好茶，集合著「養身、養氣、養顏」三大類別。*#天然嚴選好茶到精心設計禮盒， 讓您喝得健康活力、嚐得各式茶款甘甜。*#*#這世上的花花草草都是大自然的恩賜，擁有著不可思議的神奇自然能量~*#花草茶不僅適用在日常保健、還有養顏美容，放鬆身心的效果。*#鮮豔繽紛的茶色來自台灣天然有機的花草調和而成，絕不添加香精、色素等化學成分。*#飲茶入口時的甜味來自甜菊成分的天然提味，低熱量零負擔，讓您隨時都能享用。*#無添加咖啡因，怕喝茶睡不著的你可以放心飲用~', '', '', '20.00', '20.00', '20.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方法：', '*#2g*10入*#台灣*#台灣*#雲林 紫羅蘭、雲林 甜菊、雲林 檸檬草、雲林 迷迭香 、屏東 檸檬馬鞭草*#三年*#置於陰涼乾燥處，避免陽光照射。', '1', '', 10, '', '<strong>神秘紫氣女神風範</strong><br />\n紫色是紫羅蘭花的天然原色，由於紫色的光波最短，在自然界中較少見到，向來被引申為象徵高貴與神秘，手捧一杯富麗的紫色花草茶，透露出女神般神秘具魅惑的氣質。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144905_cd493.jpg&quot; /><br />\n<strong>皇家氣味滿芬芳</strong><br />\n特選有機紫羅蘭、檸檬草、馬鞭草及迷迭香等花草，飲用時口口微酸甜並伴隨撲鼻而來的滿滿花香，感覺猶如置身皇家宮廷，高貴而富有氣質。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144830_1055f.jpg&quot; /><br />\n<strong>簡單輕盈舒身心</strong><br />\n長時間久坐久站的你，快來杯馬鞭紫羅蘭茶飲放鬆一下。<br />\n舒緩你的身體與心理~微妙滋味帶給你美好的每一天。<br />\n<br />\n<strong>來自台灣精選的有機原料，給您最天然的花草茶。</strong><br />\n走訪各縣市花草與香草的發源地，尋找著天然有機能真正帶給消費者健康的原料。<br />\n嚴格篩選各式療癒效果的花草，經由調配後產出一系列色澤動人又可口的花草茶。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180724160648_79236.jpg&quot; /><br />\n<strong>馬鞭紫羅蘭原料</strong><br />\n選用雲林 紫羅蘭、雲林 甜菊、雲林 檸檬草、雲林 迷迭香 、屏東 檸檬馬鞭草 。<br />\n安心嚴選的天然有機原料，精選台灣各地有機花草與香草，調配出天然健康的茶飲。<br />\n<br />\n<strong>無含添加物、無香精、無色素</strong><br />\n絕無添加色素、香精等化學成分，鮮豔動人的色澤來自天然原料的調配而成。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144949_9958c.jpg&quot; /><br />\n<strong>無咖啡因、低熱量</strong><br />\n不添加咖啡因成分，睡前飲用不會睡不著，而是能夠放鬆身心，有助入眠。<br />\n來自甜菊的天然提味。低熱量的酸甜滋味，讓你不必擔心身材走樣的盡情品味。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806115742_b35fd.jpg&quot; /><br />\n<strong>久泡不苦澀、冷熱沖泡有不同口感</strong><br />\n與一般茶款不同。就算泡著一整天，也不會讓你有茶變得苦澀或走味的感覺。<br />\n冷泡、熱泡會有不同口感？！驚艷口感，絕對顛覆你對花草茶的想像。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144702_d6c6d.jpg&quot; />', '', '', 33, NULL, 4.0, 0, 0, 0, 'TW', 'Y', '2018-08-06 14:45:28', '2018-11-09 17:24:51', 0, 16, 'set_60f154b2812d7c665a6615f2a40d2c9a.jpg,set_06932b85cc9e073392561547c0ed0483.jpg,set_831f8776d1de6fa60ce9117f89c49189.jpg', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(223, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '【洛神玫瑰】養顏/三神八福系列', 'p577dd96e500ddd88ad0d7b7a35573a78.jpg,pb3d9ea4459521d4aaedb84da6883feca.jpg,pa71d6addc5120a614bee5b63f5d470a5.jpg', '*#【養顏-保持青春容貌，給您一整天的好心情。】*#我們聽見您講究品質的聲音，我們看見您想要獨創一格的新興茶品。*#來自台灣的嚴選好茶，集合著「養身、養氣、養顏」三大類別。*#天然嚴選好茶到精心設計禮盒， 讓您喝得健康活力、嚐得各式茶款甘甜。*#*#這世上的花花草草都是大自然的恩賜，擁有著不可思議的神奇自然能量~*#花草茶不僅適用在日常保健、還有養顏美容，放鬆身心的效果。*#鮮豔繽紛的茶色來自台灣天然有機的花草調和而成，絕不添加香精、色素等化學成分。*#飲茶入口時的甜味來自甜菊成分的天然提味，低熱量零負擔，讓您隨時都能享用。*#無添加咖啡因，怕喝茶睡不著的你可以放心飲用~', '', '', '20.00', '20.00', '20.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方法：', '*#2g*10入*#台灣*#台灣*#台東 洛神、雲林 甜菊、南投埔里 玫瑰天竺葵*#三年*#置於陰涼乾燥處，避免陽光照射。', '1', '', 10, '', '<strong>色艷通紅增能量</strong><br />\n艷紅的茶色是洛神花的天然色澤，藉由視覺的凝視，彷彿一股暖流注入般增強了身體的正能量，一口口飲入全然的自我、全然的自信，充滿了人生正向的勇氣與對未來美好的憧憬。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144827_d49da.jpg&quot; /><br />\n<strong>濃郁酸甜好滋味</strong><br />\n精選上品洛神花－入口帶微酸而順喉、酸後帶微甜，玫瑰天竺葵-入口溫潤、香氣內斂。<br />\n每一口就像享受著愛情般微酸微甜的美好，人生就該是這種美好的感覺。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144832_0ad6e.jpg&quot; /><br />\n<strong>放鬆舒壓助好眠</strong><br />\n來杯洛神玫瑰花茶來告別疲憊的一天吧！全有機天然無咖咖啡因成分，搭配洛神花與玫瑰花特有的口感與清香氣息，讓心靈與身體皆獲得解放，舒緩一天緊繃的情緒，甜甜的進入夢鄉。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144714_67840.jpg&quot; /><br />\n<strong>來自台灣精選的有機原料，給您最天然的花草茶。</strong><br />\n走訪各縣市花草與香草的發源地，尋找著天然有機能真正帶給消費者健康的原料。<br />\n嚴格篩選各式療癒效果的花草，經由調配後產出一系列色澤動人又可口的花草茶。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180724160648_79236.jpg&quot; /><br />\n<br />\n<strong>洛神玫瑰茶原料</strong><br />\n選用台東/洛神花、南投埔里/玫瑰天竺葵、雲林/甜菊。<br />\n安心嚴選的天然有機原料，精選台灣各地有機花草與香草，調配出天然健康的茶飲。<br />\n<br />\n<strong>無含添加物、無香精、無色素</strong><br />\n絕無添加色素、香精等化學成分，鮮豔動人的色澤來自天然原料的調配而成。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144949_9958c.jpg&quot; /><br />\n<strong>無咖啡因、低熱量</strong><br />\n不添加咖啡因成分，睡前飲用不會睡不著，而是能夠放鬆身心，有助入眠。<br />\n來自甜菊的天然提味。低熱量的酸甜滋味，讓你不必擔心身材走樣的盡情品味。<br />\n<br />\n<strong>久泡不苦澀、冷熱沖泡有不同口感</strong><br />\n與一般茶款不同。就算泡著一整天，也不會讓你有茶變得苦澀或走味的感覺。<br />\n冷泡、熱泡會有不同口感？！驚艷口感，絕對顛覆你對花草茶的想像。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144701_53f22.jpg&quot; />', '', '', 33, NULL, 4.0, 0, 0, 0, 'TW', 'Y', '2018-08-06 15:54:46', '2018-11-09 17:25:22', 0, 12, 'set_85807d01760ac60d763779bbe80b7d02.jpg,set_b558b83f838d4ceae92e65f8f64ffb2d.jpg,set_7fa09de5f30d244fef7e0b8dff7e90b4.jpg', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(225, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, NULL, NULL, '乾燥花香氛四入特惠組test', 'pda19cf010528924544ca6af179295e0c.jpg', '', '', '', '53.00', '53.00', '53.00', '', '', '1', '', 10, '', '茶樹、薰衣草、玫瑰、蕨葉，四款香氛各一瓶。<br />\n<br />\n<iframe width=&quot;853&quot; height=&quot;480&quot; src=&quot;https://www.youtube.com/embed/doWkrFjhTYg&quot; frameborder=&quot;0&quot; allow=&quot;autoplay; encrypted-media&quot; allowfullscreen></iframe>\n\n容量：85ml*4瓶<br />\n包裝尺寸：19.4*15.5*5cm<br />\n生產地：泰國<br />\n製造地：泰國&nbsp;<br />\n<br />\n&nbsp;', '', '', 39, NULL, 10.6, 0, 0, 0, 'TW', 'N', '2018-08-14 09:53:25', '2018-08-14 09:58:23', 23, 0, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(224, 'fa fa-heart-o', 'N', 'Y', 0, 0, 1, 'N', 'N', 1, '', NULL, '三神八福  精緻茶典藏禮盒', 'pb852d36842ec49e9c568cbdb9875e119.gif,pe25ec50ce8d31008b30bfd5cb6902673.gif,pc5aada3691d62107718c02cbf3842654.gif,pe9b773067b157589e6d35918b2b3e4d4.gif', '*#三神八福 精緻茶典藏禮盒*#在東方的宗教思想中，大自然生機乃神所恩賜。芬芳美學精選大*#自然的禮讚，設計出精緻而創新的茶飲。11種養身丶養氣丶養顏*#茶飲組成「三神八福」禮盒，藉以表達三則來自神的祝福，*#與八個神祗的隱喻。今天你被祝福了嗎？', '', '', '120.00', '120.00', '67.00', '*#【茉莉紅茶】*#成分：*#淨重：*#保存期限：*#【蜜香紅茶】*#成分：*#淨重：*#保存期限：*#【紅璲烏龍】*#成分：*#淨重：*#保存期限：*#【柚香烏龍】*#成分：*#淨重：*#保存期限：*#【牛樟凍頂烏龍茶】*#成分：*#淨重：*#保存期限：*#【紫錐花茶】*#成分：*#淨重：*#保存期限：*#【蕎麥龍眼花】*#成分：*#淨重：*#保存期限：*#【馬鞭紫羅蘭】*#成分：*#淨重：*#保存期限：*#【檸檬馬利格】*#成分：*#淨重：*#保存期限：*#【洛神玫瑰】*#成分：*#淨重：*#保存期限：*#【茱莉亞藍玫瑰】*#成分：*#淨重：*#保存期限：', '*#*#紅茶、茉莉花*#2.5g*3入*#2年*#*#紅茶*#2.5g*3入*#2年*#*#烏龍茶*#2.5g*3入*#3年*#*#白柚、烏龍茶*#2g*5入*#3年*#*#凍頂烏龍茶、七葉膽、牛樟芝子實體粉末(固態皿培)*#2g*5入*#2年*#*#紫錐花、丹蔘、甜菊*#2g*5入*#3年*#*#黃金蕎麥、七葉蘭、七葉膽、龍眼花、甜菊*#2g*5入*#3年*#2g*10*#檸檬草、檸檬馬鞭草、迷迭香、紫羅蘭、甜菊*#2g*5入*#3年*#*#檸檬草、芳香萬壽菊、蝶豆花、甜菊*#2g*5入*#3年*#*#洛神花、玫瑰天竺葵、甜菊*#2g*5入*#3年*#*#茱莉亞薄荷、玫瑰天竺葵、甜菊、蝶豆花*#2g*5入*#3年', '99', '', 20, '', '<strong>《三神八福茶款》</strong><br />\n來自台灣的嚴選好茶。<br />\n為了呈現最好的茶色、茶香與甘甜，不少茶款都有專屬的製程方式。<br />\n有的是讓您顛覆印象的鮮豔茶色，有的是比一般茶款更豐富的甘甜順口。<br />\n而最大的共同點是我們的品質優良、每款茶飲喝起來都各具特色與風味。<br />\n享受品茶的美好滋味，每一口都是難以忘懷的美味。<br />\n<br />\n<br />\n<strong>養身</strong>-統領精、氣、神，挑戰不可能。<br />\n茶款：<strong>蜜香紅茶、紫錐花茶、紅璲烏龍茶、柚香烏龍茶。</strong><br />\n<br />\n【蜜香紅茶】產地：花蓮瑞穗<br />\n蜜香紅茶是「無毒農業栽培」的意外收穫，由於茶園未施農藥，經「小綠葉蟬」吸吮後茶樹會啟動植物的防禦反應，合成單萜類及醇類物質，散發出濃濃的花果蜜香。成為蜜香紅茶最大的特色。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103008_cab50.jpg&quot; /><br />\n<br />\n【紫錐花茶】產地：花蓮<br />\n以太魯閣國家公園純淨的水源，天然無污染的花蓮有機農場，育孕源自北美有印第安神草之稱的紫錐花。添加丹參、甜菊調配出最佳口感，茶湯呈現金黃色，茶味淡雅清香，入口溫潤舒暢。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103127_18b79.jpg&quot; /><br />\n<br />\n【紅璲烏龍茶】產地：台東鹿野<br />\n一心二葉手工採摘，以重發酵、日光萎凋，結合烏龍茶與紅茶兩種工法製作的紅烏龍，茶湯呈現琥珀色，茶質厚重具熟果香，滋味醇厚圓滑，耐泡又甘醇的特性，熱泡順口、冷泡清甜。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103359_ada17.jpg&quot; /><br />\n<br />\n【柚香烏龍茶】產地：台東與鹿野<br />\n選用台東東河大白柚及鹿野手工摘採清心烏龍茶製作而成。<br />\n手工自製加上獨特製作過程，將柚子果肉挖出與茶葉混合後塞回柚身內，<br />\n經歷九蒸九曬與三十八星期風乾熟成後，才能將其敲碎入袋。<br />\n獨特的釀造方法，賦予了清新柚香與濃郁烏龍茶的完美組合。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103928_2d511.jpg&quot; /><br />\n<br />\n<strong>養氣</strong>-調養生活壓力，補充每日元氣。<br />\n茶款：<strong>牛樟凍頂烏龍茶、茉莉紅茶。</strong><br />\n<br />\n【牛樟凍頂烏龍茶】產地：南投鹿谷<br />\n使用台灣南投鹿谷特有凍頂烏龍茶，加上台灣最優質牛樟芝子實體，融合而成特殊香氣與口感，茶湯水色呈現金黃色，清香撲鼻，喉韻回甘。<br />\n(牛樟芝子實體由純菇體直接低溫研磨與萃取，富含牛樟芝子實體三萜類等指標生理活性成分，活性多醣體、SOD及腺苷等)<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180828090837_304f9.jpg&quot; /><br />\n<br />\n【茉莉紅茶】產地：彰化與梨山<br />\n選用台灣彰化花壇所種植安全無毒的茉莉花，以及高海拔梨山紅茶。以特殊「窨香」製法，將手工採收的茉莉花混合茶葉薰香乾燥，讓茶吸收花的香氣而成。茶湯溫潤澄透，花香高雅、茶湯潤口，風味細緻內斂。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103946_3023f.jpg&quot; /><br />\n<br />\n<strong>養顏</strong>-保持青春容貌，給您一整天的好心情。<br />\n茶款：<strong>洛神玫瑰、蕎麥龍眼、檸檬瑪利格、茱莉亞藍玫瑰、馬鞭紫羅蘭</strong><br />\n<br />\n【洛神玫瑰】產地：台東、南投埔里、雲林<br />\n濃郁酸甜的洛神玫瑰香氣，放鬆紓壓有助於睡眠。<br />\n無添加咖啡因、色素、香精。茶中的甜味是由甜菊天然提味，無添加代糖與其他加工糖品，健康天然且熱量低不易發胖。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144707_e726c.jpg&quot; /><br />\n<br />\n【蕎麥龍眼】產地：台南林二 、雲林<br />\n濃厚的蕎麥香氣，口感清甜 後味回甘強烈。輕鬆解開身體的渴。<br />\n無添加咖啡因、色素、香精。茶中的甜味是由甜菊天然提味，無添加代糖與其他加工糖品，健康天然且熱量低不易發胖。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827104521_de04b.jpg&quot; /><br />\n<br />\n【檸檬瑪利格】產地：雲林、屏東、花蓮<br />\n清新甘甜的口感，帶著悠悠果香與檸檬香氣，補充日常的元氣。<br />\n無添加咖啡因、色素、香精。茶中的甜味是由甜菊天然提味，無添加代糖與其他加工糖品，健康天然且熱量低不易發胖。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144709_6f006.jpg&quot; /><br />\n<br />\n【茱莉亞藍玫瑰】產地：花蓮、南投埔里、雲林<br />\n芬芳微甜並帶著玫瑰香氣，解開紊亂不安的煩躁心情。<br />\n無添加咖啡因、色素、香精。茶中的甜味是由甜菊天然提味，無添加代糖與其他加工糖品，健康天然且熱量低不易發胖。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144705_649c5.jpg&quot; /><br />\n<br />\n【馬鞭紫羅蘭】產地：雲林、屏東<br />\n微酸甜的美好滋味搭配淡淡花香，舒緩你的身心理。<br />\n無添加咖啡因、色素、香精。茶中的甜味是由甜菊天然提味，無添加代糖與其他加工糖品，健康天然且熱量低不易發胖。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144710_f2900.jpg&quot; /><br />\n<br />\n天然有機，不添加色素、咖啡因等 化學物質。堅持給您享受最天然健康的飲品。<br />\n顛覆傳統茶色思維，給您不同凡響的茶饗宴。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144715_790cd.jpg&quot; />', '', '', 33, NULL, 24.0, 0, 0, 0, 'TW', 'Y', '2018-08-13 15:55:46', '2018-11-09 17:27:30', 1, 5, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(226, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '【蕎麥龍眼花】養顏/三神八福系列', 'p6a5e64c48ca4e941d0989617df722215.jpg,p1d85288770205b3980ace5ca029c81c7.jpg,p6dc93f370554a0c474c8802793cedc17.jpg', '*#【養顏-保持青春容貌，補充一天好心情。】*#我們聽見您講究品質的聲音，我們看見您想要獨創一格的新興茶品。*#來自台灣的嚴選好茶，集合著「養身、養氣、養顏」三大類別。*#天然嚴選好茶到精心設計禮盒， 讓您喝得健康活力、嚐得各式茶款甘甜。*#*#這世上的花花草草都是大自然的恩賜，擁有著不可思議的神奇自然能量~*#花草茶不僅適用在日常保健、還有養顏美容，放鬆身心的效果。*#鮮豔繽紛的茶色來自台灣天然有機的花草調和而成，絕不添加香精、色素等化學成分。*#飲茶入口時的甜味來自甜菊成分的天然提味，低熱量零負擔，讓您隨時都能享用。*#無添加咖啡因，怕喝茶睡不著的你可以放心飲用~', '', '', '20.00', '20.00', '20.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方法：', '*#2g*10入*#台灣*#台灣*#台南林二 黃金蕎麥、雲林 甜菊、雲林 七葉膽、雲林 七葉蘭、雲林土庫 龍眼花*#三年*#置於陰涼乾燥處，避免陽光照射。', '1', '', 10, '', '<strong><img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144349_519db.jpg&quot; /><br />\n清新明亮如湧泉</strong><br />\n亮黃色的茶色是黃金蕎麥、龍眼花、七葉蘭等天然成分融合而成的原色，<br />\n明亮清新的黃色立即帶來源源不絕的活力感，如同湧泉般川流不息。<br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144350_43c2d.jpg&quot; /><br />\n<strong>甜水淡雅立回甘</strong><br />\n初嘗蕎麥龍眼花茶飲的味道即是甜水淡雅，然而後味回甘強烈，一解身體的乾渴，<br />\n每一口回甘回甘再回甘，體嚐禪學領域般的人生百味雋永不息。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144350_31921.jpg&quot; /><br />\n<strong>細水長流保活力</strong><br />\n隨時來杯有機天然蕎麥龍眼花茶回饋你渴望的人生吧！<br />\n人生的渴望何其多，細水長流才能常保活力，回甘的人生才值得一再的品嘗。<br />\n<br />\n<strong>來自台灣精選的有機原料，給您最天然的花草茶。</strong><br />\n走訪各縣市花草與香草的發源地，尋找著天然有機能真正帶給消費者健康的原料。<br />\n嚴格篩選各式療癒效果的花草，經由調配後產出一系列色澤動人又可口的花草茶。<br />\n<br />\n<br />\n<strong>蕎麥龍眼花茶原料</strong><br />\n選用台南二林-黃金蕎麥、雲林土庫-龍眼花、雲林-甜菊 七葉膽 七葉蘭。<br />\n安心嚴選的天然有機原料，精選台灣各地有機花草與香草，調配出天然健康的茶飲。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144351_2e987.jpg&quot; /><br />\n<br />\n<strong>無含添加物、無香精、無色素</strong><br />\n絕無添加色素、香精等化學成分，鮮豔動人的色澤來自天然原料的調配而成。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144351_810c2.jpg&quot; /><br />\n<strong>無咖啡因、低熱量</strong><br />\n不添加咖啡因成分，睡前飲用不會睡不著，而是能夠放鬆身心，有助入眠。<br />\n來自甜菊的天然提味。低熱量的酸甜滋味，讓你不必擔心身材走樣的盡情品味。<br />\n<br />\n<strong>久泡不苦澀、冷熱沖泡有不同口感</strong><br />\n與一般茶款不同。就算泡著一整天，也不會讓你有茶變得苦澀或走味的感覺。<br />\n冷泡、熱泡會有不同口感？！驚艷口感，絕對顛覆你對花草茶的想像。', '', '', 33, NULL, 4.0, 0, 0, 0, 'TW', 'Y', '2018-08-14 10:34:52', '2018-11-09 17:30:00', 0, 13, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(227, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '【茱莉亞藍玫瑰】養顏/三神八福系列', 'p26395982ec0e9cf39cadd446de61a910.jpg,p3bfef7008f6b564b56e299784dfb09e7.jpg,pe1df375aa266f6707364bc73ffd2b885.jpg', '*#【養顏-保持青春容貌，補充一天好心情。】*#我們聽見您講究品質的聲音，我們看見您想要獨創一格的新興茶品。*#來自台灣的嚴選好茶，集合著「養身、養氣、養顏」三大類別。*#天然嚴選好茶到精心設計禮盒， 讓您喝得健康活力、嚐得各式茶款甘甜。*#*#這世上的花花草草都是大自然的恩賜，擁有著不可思議的神奇自然能量~*#花草茶不僅適用在日常保健、還有養顏美容，放鬆身心的效果。*#鮮豔繽紛的茶色來自台灣天然有機的花草調和而成，絕不添加香精、色素等化學成分。*#飲茶入口時的甜味來自甜菊成分的天然提味，低熱量零負擔，讓您隨時都能享用。*#無添加咖啡因，怕喝茶睡不著的你可以放心飲用~', '', '', '20.00', '20.00', '20.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方法：', '*#2g*10入*#台灣*#台灣*#茱莉亞薄荷 花蓮 蝶豆花、南投埔里 玫瑰天竺葵、雲林 甜菊*#三年*#置於陰涼乾燥處，避免陽光照射。', '1', '', 10, '', '<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144714_00371.jpg&quot; /><br />\n<strong>湛藍知性解靈性</strong><br />\n湛藍的茶色是茱莉亞薄荷與蝶豆花的天然原色，喝著手中的茶飲，就像直接溝通了紊亂的知性與不安的靈性，輝映著遼闊的藍天，煩躁豁然開朗。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144721_78fab.jpg&quot; /><br />\n<strong>舒心自在飲開懷</strong><br />\n茶飲的風味芬芳微甜，啜飲間滲露出類似玫瑰般縈繞的香氛，讓人感到無比舒心平靜，惡魔的鬱悶轉瞬間變成了天使的遐想。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144723_2790a.jpg&quot; /><br />\n<strong>寧神靜氣解百憂</strong><br />\n特別推薦給想要心情平靜、需要思考、或與人商議時來上一杯！<br />\n如同奔向大海般心曠神怡，不知不覺煩惱竟迎刃而解。<br />\n<br />\n<strong>來自台灣精選的有機原料，給您最天然的花草茶。</strong><br />\n走訪各縣市花草與香草的發源地，尋找著天然有機能真正帶給消費者健康的原料。<br />\n嚴格篩選各式療癒效果的花草，經由調配後產出一系列色澤動人又可口的花草茶。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144725_48b94.jpg&quot; /><br />\n<strong>茱莉亞藍玫瑰原料</strong><br />\n選用雲林-茱莉亞薄荷、花蓮-蝶豆花、南投埔里-玫瑰天竺葵、雲林-甜菊。<br />\n安心嚴選的天然有機原料，精選台灣各地有機花草與香草，調配出天然健康的茶飲。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144725_48b94.jpg&quot; /><br />\n<strong>無含添加物、無香精、無色素</strong><br />\n絕無添加色素、香精等化學成分，鮮豔動人的色澤來自天然原料的調配而成。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808144727_386c7.jpg&quot; /><br />\n<strong>無咖啡因、低熱量</strong><br />\n不添加咖啡因成分，睡前飲用不會睡不著，而是能夠放鬆身心，有助入眠。<br />\n來自甜菊的天然提味。低熱量的酸甜滋味，讓你不必擔心身材走樣的盡情品味。<br />\n<br />\n<strong>久泡不苦澀、冷熱沖泡有不同口感</strong><br />\n與一般茶款不同。就算泡著一整天，也不會讓你有茶變得苦澀或走味的感覺。<br />\n冷泡、熱泡會有不同口感？！驚艷口感，絕對顛覆你對花草茶的想像。', '', '', 33, NULL, 4.0, 0, 0, 0, 'TW', 'Y', '2018-08-14 11:08:46', '2018-11-09 17:30:28', 0, 15, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(228, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '【檸檬瑪利格】養顏/三神八福系列', 'p914c9614ce496444c40cc2257f72afd5.png', '*#【養顏-保持青春容貌，補充一天好心情。】*#我們聽見您講究品質的聲音，我們看見您想要獨創一格的新興茶品。*#來自台灣的嚴選好茶，集合著「養身、養氣、養顏」三大類別。*#天然嚴選好茶到精心設計禮盒， 讓您喝得健康活力、嚐得各式茶款甘甜。*#*#這世上的花花草草都是大自然的恩賜，擁有著不可思議的神奇自然能量~*#花草茶不僅適用在日常保健、還有養顏美容，放鬆身心的效果。*#鮮豔繽紛的茶色來自台灣天然有機的花草調和而成，絕不添加香精、色素等化學成分。*#飲茶入口時的甜味來自甜菊成分的天然提味，低熱量零負擔，讓您隨時都能享用。*#無添加咖啡因，怕喝茶睡不著的你可以放心飲用~', '', '', '20.00', '20.00', '20.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方式：', '*#2g*10入*#台灣*#台灣*#花蓮 蝶豆花、屏東 芳香萬壽菊、雲林 檸檬草、雲林 甜菊*#三年*#置於陰涼乾燥處，避免陽光照射。', '1', '', 10, '', '<strong>綠意盎然富活力</strong><br />\n翠綠色的茶色是檸檬草的原色，輔以芳香萬壽菊、蝶豆花等花草調合，色澤更顯豐富層次，印入眼簾的綠色元素彷彿活絡身體每個細胞、療癒所有的倦怠。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808094733_030e9.jpg&quot; /><br />\n<br />\n<strong>清新甘甜醒元氣</strong><br />\n清新甘甜的口感帶著悠悠的果香與檸檬香，喝下的瞬間好似在綠色草原間如沐春風，精疲力竭感覺一掃而空，元氣滿滿。<br />\n<br />\n<br />\n<strong>光合生機樂悠活</strong><br />\n一大早就來杯有機檸檬瑪麗格樂活你的人生吧！<br />\n就像綠色植物對陽光行光合作用般，獲得滿滿活力，精神奕奕再面對挑戰！<br />\n<br />\n<strong>來自台灣精選的有機原料，給您最天然的花草茶。</strong><br />\n走訪各縣市花草與香草的發源地，尋找著天然有機能真正帶給消費者健康的原料。<br />\n嚴格篩選各式療癒效果的花草，經由調配後產出一系列色澤動人又可口的花草茶。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808094734_3acb1.jpg&quot; /><br />\n<br />\n<strong>檸檬瑪利格原料</strong><br />\n選用屏東-芳香萬壽菊、花蓮-蝶豆花、雲林-甜菊 檸檬草。<br />\n安心嚴選的天然有機原料，精選台灣各地有機花草與香草，調配出天然健康的茶飲。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808094735_baa07.jpg&quot; /><br />\n<br />\n<strong>無含添加物、無香精、無色素</strong><br />\n絕無添加色素、香精等化學成分，鮮豔動人的色澤來自天然原料的調配而成。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808094735_af657.jpg&quot; /><br />\n<strong>無咖啡因、低熱量</strong><br />\n不添加咖啡因成分，睡前飲用不會睡不著，而是能夠放鬆身心，有助入眠。<br />\n來自甜菊的天然提味。低熱量的酸甜滋味，讓你不必擔心身材走樣的盡情品味。<br />\n<br />\n<strong>久泡不苦澀、冷熱沖泡有不同口感</strong><br />\n與一般茶款不同。就算泡著一整天，也不會讓你有茶變得苦澀或走味的感覺。<br />\n冷泡、熱泡會有不同口感？！驚艷口感，絕對顛覆你對花草茶的想像。', '', '', 33, NULL, 4.0, 0, 0, 0, 'TW', 'Y', '2018-08-14 11:12:22', '2019-07-26 16:09:56', 0, 14, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(261, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, 'dfdsfd', NULL, 'sdfdsfdsf', 'pec9d07c1da09da3467e4cd03247d8c3d.png', '', '', '', '10.00', '10.00', '10.00', '', '', '100', '', 5, '', '123', '', '', 35, NULL, 1.0, 0, 10, 0, '', 'Y', '2019-07-31 11:22:15', '2019-07-31 11:22:15', 2, 0, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(229, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, NULL, NULL, 'TEST五彩有機花草茶 - 馬鞭紫羅蘭', 'p3452719a791437746b0b862a107804ac.jpg,p652cf68922fb3587accab038b60de7a5.jpg,p88dd6679df0e0135f6d9e51e1661698b.jpg', '*#這世上的花花草草都是大自然的恩賜，擁有著不可思議的神奇自然能量~*#花草茶不僅適用在日常保健、還有養顏美容，放鬆身心的效果。*#鮮豔繽紛的茶色來自台灣天然有機的花草調和而成，絕不添加香精、色素等化學成分。*#飲茶入口時的甜味來自甜菊成分的天然提味，低熱量零負擔，讓您隨時都能享用。*#無添加咖啡因，怕喝茶睡不著的你可以放心飲用~', '', '', '15.00', '15.00', '15.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方法：', '*#2g*10入*#台灣*#台灣*#雲林 紫羅蘭、雲林 甜菊、雲林 檸檬草、雲林 迷迭香 、屏東 檸檬馬鞭草*#三年*#置於陰涼乾燥處，避免陽光照射。', '1', '', 999, '', '<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180807171822_fc5a7.jpg&quot; /><br />\n<strong>神秘紫氣女神風範</strong><br />\n紫色是紫羅蘭花的天然原色，由於紫色的光波最短，在自然界中較少見到，向來被引申為象徵高貴與神秘，手捧一杯富麗的紫色花草茶，透露出女神般神秘具魅惑的氣質。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808093258_e7f5a.jpg&quot; /><br />\n<br />\n<strong>皇家氣味滿芬芳</strong><br />\n特選有機紫羅蘭、檸檬草、馬鞭草及迷迭香等花草，飲用時口口微酸甜並伴隨撲鼻而來的滿滿花香，感覺猶如置身皇家宮廷，高貴而富有氣質。<br />\n<br />\n<strong>簡單輕盈舒身心</strong><br />\n長時間久坐久站的你，快來杯馬鞭紫羅蘭茶飲放鬆一下。<br />\n舒緩你的身體與心理~微妙滋味帶給你美好的每一天。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808093259_42db0.jpg&quot; /><br />\n<br />\n<strong>來自台灣精選的有機原料，給您最天然的花草茶。</strong><br />\n走訪各縣市花草與香草的發源地，尋找著天然有機能真正帶給消費者健康的原料。<br />\n嚴格篩選各式療癒效果的花草，經由調配後產出一系列色澤動人又可口的花草茶。<br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808093259_99db0.jpg&quot; /><br />\n<br />\n<strong>馬鞭紫羅蘭原料</strong><br />\n選用雲林 紫羅蘭、雲林 甜菊、雲林 檸檬草、雲林 迷迭香 、屏東 檸檬馬鞭草 。<br />\n安心嚴選的天然有機原料，精選台灣各地有機花草與香草，調配出天然健康的茶飲。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808093300_5f5e2.jpg&quot; /><br />\n<strong>無含添加物、無香精、無色素</strong><br />\n絕無添加色素、香精等化學成分，鮮豔動人的色澤來自天然原料的調配而成。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180808093300_da671.jpg&quot; /><br />\n<br />\n<strong>無咖啡因、低熱量</strong><br />\n不添加咖啡因成分，睡前飲用不會睡不著，而是能夠放鬆身心，有助入眠。<br />\n來自甜菊的天然提味。低熱量的酸甜滋味，讓你不必擔心身材走樣的盡情品味。<br />\n<br />\n<strong>久泡不苦澀、冷熱沖泡有不同口感</strong><br />\n與一般茶款不同。就算泡著一整天，也不會讓你有茶變得苦澀或走味的感覺。<br />\n冷泡、熱泡會有不同口感？！驚艷口感，絕對顛覆你對花草茶的想像。', '', '', 33, NULL, 15.0, 0, 0, 0, 'TW', 'N', '2018-08-14 11:33:57', '2018-08-14 11:45:21', 0, 0, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(230, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '【茉莉紅茶】養氣/三神八福系列', 'pdfdbaea921535de9b50c54041b256e20.jpg', '*#【養氣-調養生活壓力，補充每日元氣。】*#我們聽見您講究品質的聲音，我們看見您想要獨創一格的新興茶品。*#來自台灣的嚴選好茶，集合著「養身、養氣、養顏」三大類別。*#天然嚴選好茶到精心設計禮盒， 讓您喝得健康活力、嚐得各式茶款甘甜。*#', '', '', '20.00', '20.00', '20.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方式：', '*#2g*10入*#台灣*#台灣*#台中梨山 紅茶、彰化花壇 茉莉*#二年*#置於陰涼乾燥處，避免陽光照射。', '50', '', 10, '', '選用台灣彰化花壇所種植安全無毒的茉莉花，以及高海拔梨山紅茶。<br />\n以特殊製法，將手工採收的茉莉花混合茶葉薰香乾燥，讓茶吸收花的香氣而成，亦稱「窨香」。<br />\n窨製花茶又常被稱為香片。最早可追溯至中國南宋就有茉莉花窨茶的相關記錄。<br />\n茶引花香，花增茶味，茶湯溫潤澄透，花香高雅、茶湯潤口，風味細緻內斂。&nbsp;<br />\n如此珍貴的好茶，不僅製成特殊雅致，喝起來細緻順口，值得細細品味。<br />\n&nbsp;<br />\n建議沖泡方式：<br />\n冷泡 常溫&nbsp;&nbsp; 250ml&nbsp;&nbsp; 冷藏6小時<br />\n熱泡 85℃&nbsp;&nbsp; 250ml&nbsp;&nbsp; 3-5分鐘<br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103946_3023f.jpg&quot; />', '', '', 33, NULL, 4.0, 0, 0, 0, 'TW', 'Y', '2018-08-14 12:00:57', '2018-11-09 17:31:10', 1, 10, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(231, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '【牛樟凍頂烏龍茶】養氣/三神八福系列', 'p975caf5ecf1aed5dbf5c0835e01c69bc.jpg', '*#【養氣-調養生活壓力，補充每日元氣。】*#我們聽見您講究品質的聲音，我們看見您想要獨創一格的新興茶品。*#來自台灣的嚴選好茶，集合著「養身、養氣、養顏」三大類別。*#天然嚴選好茶到精心設計禮盒， 讓您喝得健康活力、嚐得各式茶款甘甜。*#', '', '', '20.00', '20.00', '20.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方式：', '*#2g*10入*#台灣*#台灣*#南投鹿谷 凍頂烏龍茶、雲林 七葉膽、新竹 牛樟芝子實體粉末(固態皿培)*#三年*#置於陰涼乾燥處，避免陽光照射。', '50', '', 10, '', '使用台灣南投鹿谷特有凍頂烏龍茶，加上台灣最優質牛樟芝子實體，融合而成特殊香氣與口感；<br />\n茶湯水色呈現金黃色，清香撲鼻，喉韻回甘。<br />\n(牛樟芝子實體由純菇體直接低溫研磨與萃取，富含牛樟芝子實體三萜類等指標生理活性成分，活性多醣體、SOD及腺苷等)<br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180828090837_304f9.jpg&quot; />', '', '', 33, NULL, 4.0, 0, 0, 0, 'TW', 'Y', '2018-08-14 12:01:31', '2018-11-09 17:31:38', 1, 11, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(232, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '【蜜香紅茶】養身/三神八福系列', 'p6d0d13293804b807e25ecd843a5ccbdb.jpg', '*#【養身-統領精、氣、神，挑戰不可能。】*#我們聽見您講究品質的聲音，我們看見您想要獨創一格的新興茶品。*#來自台灣的嚴選好茶，集合著「養身、養氣、養顏」三大類別。*#天然嚴選好茶到精心設計禮盒， 讓您喝得健康活力、嚐得各式茶款甘甜。*#', '', '', '20.00', '20.00', '20.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方式：', '*#2g*10入*#台灣*#台灣*#花蓮瑞穗  紅茶*#二年*#置於陰涼乾燥處，避免陽光照射。', '50', '', 10, '', '來自花蓮瑞穗的蜜香紅茶是「無毒農業栽培」的意外收穫，由於茶園未施農藥，經「小綠葉蟬」吸吮後茶樹會啟動植物的防禦反應，合成單萜類及醇類物質，散發出濃濃的花果蜜香。成為蜜香紅茶最大的特色。<br />\n<br />\n經過嚴格把關發酵濕度與含水量等項目，使蜜香紅茶的香氣保存更完美。<br />\n茶湯呈現香檳色，在沖泡過程中散發出濃郁而獨特的果香、蜜香、花香。<br />\n是一款甘美可口的茶品，入喉滋味甘甜柔順，且含有濃厚的蜜香氣息。<br />\n<br />\n建議沖泡方式：<br />\n冷泡 常溫&nbsp;&nbsp; 300ml&nbsp; 冷藏6小時<br />\n熱泡 85℃&nbsp;&nbsp; 300ml&nbsp;&nbsp; 3-5分鐘<br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103008_cab50.jpg&quot; /><br />\n<br />\n<span style=&quot;font-size:20px&quot;>農產合格證明：</span><br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20181115111335_ef96d.jpg&quot; />', '', '', 33, NULL, 4.0, 0, 0, 0, 'TW', 'Y', '2018-08-14 12:02:28', '2018-11-15 11:14:54', 1, 9, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(233, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '【紫錐花茶】養身/三神八福系列', 'pc1fee4f340d164ccb395b39abbe84767.jpg', '*#【養身-統領精、氣、神，挑戰不可能。】*#我們聽見您講究品質的聲音，我們看見您想要獨創一格的新興茶品。*#來自台灣的嚴選好茶，集合著「養身、養氣、養顏」三大類別。*#天然嚴選好茶到精心設計禮盒， 讓您喝得健康活力、嚐得各式茶款甘甜。*#', '', '', '20.00', '20.00', '20.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方式：', '*#2g*10入*#台灣*#台灣*#花蓮吉安  紫錐花、花蓮 丹蔘、花蓮 甜菊*#三年*#置於陰涼乾燥處，避免陽光照射。', '50', '', 10, '', '以太魯閣國家公園純淨的水源，天然無污染的花蓮有機農場，育孕源自北美有印第安神草之稱的紫錐花。添加丹參、甜菊調配出最佳口感，茶湯呈現金黃色，茶味淡雅清香，入口溫潤舒暢。<br />\n<br />\n從1930年代引進到歐洲，成為歐美第二大保健植物。富含對人體重要的關鍵活性多醣體、烷酼胺、菊苣酸，有助於調節生理機能及健康維持。<br />\n&nbsp;<br />\n建議沖泡方式：<br />\n冷泡 常溫&nbsp;&nbsp; 300ml&nbsp; 15分鐘或冷藏4-6小時<br />\n熱泡 85℃&nbsp;&nbsp; 300ml&nbsp;&nbsp; 3-5分鐘<br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103127_18b79.jpg&quot; />', '', '', 33, NULL, 4.0, 0, 0, 0, 'TW', 'Y', '2018-08-14 12:03:27', '2018-11-09 17:32:34', 1, 8, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(234, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '【紅璲烏龍茶】養身/三神八福系列', 'pbd6d69c9424a230df5e6c3e1d3de001b.jpg', '*#【養身-統領精、氣、神，挑戰不可能。】*#我們聽見您講究品質的聲音，我們看見您想要獨創一格的新興茶品。*#來自台灣的嚴選好茶，集合著「養身、養氣、養顏」三大類別。*#天然嚴選好茶到精心設計禮盒， 讓您喝得健康活力、嚐得各式茶款甘甜。*#', '', '', '20.00', '20.00', '20.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方式：', '*#2g*10入*#台灣*#台灣*#台東鹿野  烏龍茶*#三年*#置於陰涼乾燥處，避免陽光照射。', '50', '', 10, '', '一心二葉手工採摘，以重發酵、日光萎凋，結合烏龍茶與紅茶兩種工法製作的紅烏龍，茶湯呈現琥珀色，茶質厚重具熟果香，滋味醇厚圓滑，耐泡又甘醇的特性，熱泡順口、冷泡清甜。<br />\n&nbsp;<br />\n不使用除草劑與化學肥料。<br />\n堅持以人工除草與全面施放植物性有機肥料的方式，製出健康有機的茶葉。<br />\n除了對製作過程講究外，連工作人員的服裝也要把關，杜絕所有汙染物。<br />\n進茶廠前需換上工作服、專屬拖鞋、口罩等等一個都不能少。<br />\n嚴格管制每個小細節，就是為了給消費者忍不住想再三回味的有機好茶。<br />\n<br />\n建議沖泡方式：<br />\n冷泡 常溫&nbsp;&nbsp; 500ml&nbsp; 冷藏6小時<br />\n熱泡 85℃&nbsp;&nbsp; 300ml&nbsp;&nbsp; 3-5分鐘<br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103359_ada17.jpg&quot; />', '', '', 33, NULL, 4.0, 0, 0, 0, 'TW', 'Y', '2018-08-14 13:30:28', '2018-11-09 17:38:47', 1, 6, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(235, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '【柚香烏龍茶】養身/三神八福系', 'p3b94ca4dae9cc8bde9eb53a7f867f110.jpg', '*#【養身-統領精、氣、神，挑戰不可能。】*#我們聽見您講究品質的聲音，我們看見您想要獨創一格的新興茶品。*#來自台灣的嚴選好茶，集合著「養身、養氣、養顏」三大類別。*#天然嚴選好茶到精心設計禮盒， 讓您喝得健康活力、嚐得各式茶款甘甜。*#', '', '', '20.00', '20.00', '20.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方式：', '*#2g*10入*#台灣*#台灣*#台東東河  白柚、台東鹿野  烏龍茶*#三年*#置於陰涼乾燥處，避免陽光照射。', '50', '', 10, '', '選用台東東河大白柚及鹿野手工摘採清心烏龍茶製作而成。<br />\n手工自製加上獨特製作過程，將柚子果肉挖出與茶葉混合後塞回柚身內，<br />\n經歷九蒸九曬與三十八星期風乾熟成後，才能將其敲碎入袋。<br />\n獨特的釀造方法，賦予了清新柚香與濃郁烏龍茶的完美組合。<br />\n&nbsp;<br />\n一杯杯紅黑茶色的柚香烏龍，醇厚爽口並帶著淡淡柚香。<br />\n是世上難得可貴的珍稀果茶，讚不絕口的獨特滋味。<br />\n&nbsp;&nbsp;<br />\n建議沖泡方式：<br />\n冷泡 常溫&nbsp;&nbsp; 500ml&nbsp; 冷藏6小時<br />\n熱泡 85℃&nbsp;&nbsp; 300ml&nbsp;&nbsp; 3-5分鐘<br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103928_2d511.jpg&quot; />', '', '', 33, NULL, 4.0, 0, 0, 0, 'TW', 'Y', '2018-08-14 13:31:05', '2018-11-09 17:39:22', 1, 7, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
