INSERT INTO `products` VALUES(247, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, NULL, NULL, '茉莉紅茶  養氣/三神八福系列', 'pa95ac3295d5eb006652107c85982087f.jpg', '*#【養氣-調養生活壓力，補充每日元氣。】*#我們聽見您講究品質的聲音，我們看見您想要獨創一格的新興茶品。*#來自台灣的嚴選好茶，集合著「養身、養氣、養顏」三大類別。*#天然嚴選好茶到精心設計禮盒， 讓您喝得健康活力、嚐得各式茶款甘甜。*#', '', '', '15.00', '15.00', '15.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方式：', '*#2g*10入*#台灣*#台灣*#花蓮 蝶豆花、屏東 芳香萬壽菊、雲林 檸檬草、雲林 甜菊*#三年*#置於陰涼乾燥處，避免陽光照射。', '50', '', 10, '', '', '', '', 33, NULL, 15.0, 0, 0, 0, 'TW', 'N', '2018-08-15 13:22:15', '2018-08-15 13:23:13', 1, 0, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(248, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, NULL, NULL, '【蜜香紅茶】養身/三神八福系列', 'pb749905318524ddac43b1859f39c6c3e.jpg', '*#【養身-統領精、氣、神，挑戰不可能。】*#我們聽見您講究品質的聲音，我們看見您想要獨創一格的新興茶品。*#來自台灣的嚴選好茶，集合著「養身、養氣、養顏」三大類別。*#天然嚴選好茶到精心設計禮盒， 讓您喝得健康活力、嚐得各式茶款甘甜。*#*#蜜香紅茶', '', '', '15.00', '15.00', '15.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方式：', '*#2g*10入*#台灣*#台灣*#花蓮 蝶豆花、屏東 芳香萬壽菊、雲林 檸檬草、雲林 甜菊*#三年*#置於陰涼乾燥處，避免陽光照射。', '50', '', 10, '', '來自花蓮瑞穗的蜜香紅茶是「無毒農業栽培」的意外收穫，由於茶園未施農藥，經「小綠葉蟬」吸吮後茶樹會啟動植物的防禦反應，合成單萜類及醇類物質，散發出濃濃的花果蜜香。成為蜜香紅茶最大的特色。<br />\n<br />\n經過嚴格把關發酵濕度與含水量等項目，使蜜香紅茶的香氣保存更完美。<br />\n茶湯呈現香檳色，在沖泡過程中散發出濃郁而獨特的果香、蜜香、花香。<br />\n是一款甘美可口的茶品，入喉滋味甘甜柔順，且含有濃厚的蜜香氣息。<br />\n<br />\n產地來源：花蓮瑞穗<br />\n<br />\n建議沖泡方式：<br />\n冷泡 常溫&nbsp;&nbsp; 300ml&nbsp; 冷藏6小時<br />\n熱泡 85℃&nbsp;&nbsp; 300ml&nbsp;&nbsp; 3-5分鐘', '', '', 33, NULL, 15.0, 0, 0, 0, 'TW', 'N', '2018-08-15 13:40:44', '2018-08-15 13:40:44', 1, 0, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
