INSERT INTO `products` VALUES(252, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '乾燥花香氛-蕨葉', 'p7f4ff3bbc39df765be0100294fa92879.jpg', '', '', '', '13.00', '13.00', '13.00', '*#生產地：*#製造地：*#容量：*#重量(含包裝)：*#包裝尺寸：', '*#泰國 *#泰國 *#85ml*#210g*#15*4.5*4.5cm', '11', '', 10, '', '來自泰國的天然乾燥香氛-蕨葉。<br />\n適合使用在居家、辦公室內，為生活空間添增清新香味。<br />\n<br />\n味道清新、簡單，不複雜的香氛小物。<br />\n可以依個人喜好選擇不同的組合，給生活空間帶來不同感受。<br />\n<br />\n生產地：泰國<br />\n製造地：泰國<br />\n容量：85ml<br />\n重量(含包裝)：210g<br />\n包裝尺寸：15*4.5*4.5cm<br />\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180816173828_a11c9.jpg&quot; />', '', '', 20, NULL, 2.6, 0, 0, 0, 'TW', 'Y', '2018-08-16 14:19:09', '2019-07-25 09:55:05', 6, 0, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(253, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, '乾燥花香氛四入特惠組', 'pade9bc566265f9c61f1c681e3e63369d.jpg,p3d130de8548db4aa3ba94ff44566e08d.jpg', '', '', '', '53.00', '53.00', '53.00', '', '', '0', '', 10, '', '來自泰國的天然乾燥香氛系列。<br />\r\n茶樹、薰衣草、玫瑰、蕨葉，四款香氛一次擁有。<br />\r\n適合使用在居家、辦公室內，為生活空間添增清新香味。<br />\r\n<br />\r\n味道清新、簡單，不複雜的香氛小物。<br />\r\n可以依個人喜好選擇不同的組合，給生活空間帶來不同感受。<br />\r\n<br />\r\n生產地：泰國<br />\r\n製造地：泰國<br />\r\n容量：85ml*4瓶<br />\r\n包裝尺寸：19.4*15.5*5cm<br />\r\n<br />\r\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180817152715_232a6.jpg&quot; />', '', '', 28, NULL, 10.6, 0, 0, 0, 'TW', 'Y', '2018-08-16 14:19:26', '2018-11-09 17:44:05', 23, 0, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(254, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, NULL, NULL, 'TEST三神八福  精緻茶典藏禮盒', 'pc0a53db0ea2c882c477668067e60f574.jpg', '*#三神八福 精緻茶典藏禮盒*#在東方的宗教思想中，大自然生機乃神所恩賜。芬芳美學精選大*#自然的禮讚，設計出精緻而創新的茶飲。11種養身丶養氣丶養顏*#茶飲組成「三神八福」禮盒，藉以表達三則來自神的祝福，*#與八個神祗的隱喻。今天你被祝福了嗎？', '', '', '83.00', '67.00', '67.00', '*#【茉莉紅茶】*#成分：*#淨重：*#保存期限：*#【蜜香紅茶】*#成分：*#淨重：*#保存期限：*#【紅璲烏龍】*#成分：*#淨重：*#保存期限：*#【柚香烏龍】*#成分：*#淨重：*#保存期限：*#【牛樟凍頂烏龍茶】*#成分：*#淨重：*#保存期限：*#【紫錐花茶】*#成分：*#淨重：*#保存期限：*#【蕎麥龍眼花】*#成分：*#淨重：*#保存期限：*#【馬鞭紫羅蘭】*#成分：*#淨重：*#保存期限：*#【檸檬馬利格】*#成分：*#淨重：*#保存期限：*#【洛神玫瑰】*#成分：*#淨重：*#保存期限：*#【茱莉亞藍玫瑰】*#成分：*#淨重：*#保存期限：', '*#*#紅茶、茉莉花*#2.5g*3入*#2年*#*#紅茶*#2.5g*3入*#2年*#*#烏龍茶*#2.5g*3入*#3年*#*#白柚、烏龍茶*#2g*5入*#3年*#*#凍頂烏龍茶、七葉膽、牛樟芝子實體粉末(固態皿培)*#2g*5入*#2年*#*#紫錐花、丹蔘、甜菊*#2g*5入*#3年*#*#黃金蕎麥、七葉蘭、七葉膽、龍眼花、甜菊*#2g*5入*#3年*#2g*10*#檸檬草、檸檬馬鞭草、迷迭香、紫羅蘭、甜菊*#2g*5入*#3年*#*#檸檬草、芳香萬壽菊、蝶豆花、甜菊*#2g*5入*#3年*#*#洛神花、玫瑰天竺葵、甜菊*#2g*5入*#3年*#*#茱莉亞薄荷、玫瑰天竺葵、甜菊、蝶豆花*#2g*5入*#3年', '100', '', 20, '', '<strong>《三神八福茶款》</strong><br />\n來自台灣的嚴選好茶。<br />\n為了呈現最好的茶色、茶香與甘甜，不少茶款都有專屬的製程方式。<br />\n有的是讓您顛覆印象的鮮豔茶色，有的是比一般茶款更豐富的甘甜順口。<br />\n而最大的共同點是我們的品質優良、每款茶飲喝起來都各具特色與風味。<br />\n享受品茶的美好滋味，每一口都是難以忘懷的美味。<br />\n<br />\n<br />\n<strong>養身</strong>-統領精、氣、神，挑戰不可能。<br />\n茶款：<strong>蜜香紅茶、紫錐花茶、紅璲烏龍茶、柚香烏龍茶。</strong><br />\n<br />\n【蜜香紅茶】產地：花蓮瑞穗<br />\n蜜香紅茶是「無毒農業栽培」的意外收穫，由於茶園未施農藥，經「小綠葉蟬」吸吮後茶樹會啟動植物的防禦反應，合成單萜類及醇類物質，散發出濃濃的花果蜜香。成為蜜香紅茶最大的特色。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103008_cab50.jpg&quot; /><br />\n<br />\n【紫錐花茶】產地：花蓮<br />\n以太魯閣國家公園純淨的水源，天然無污染的花蓮有機農場，育孕源自北美有印第安神草之稱的紫錐花。添加丹參、甜菊調配出最佳口感，茶湯呈現金黃色，茶味淡雅清香，入口溫潤舒暢。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103127_18b79.jpg&quot; /><br />\n<br />\n【紅璲烏龍茶】產地：台東鹿野<br />\n一心二葉手工採摘，以重發酵、日光萎凋，結合烏龍茶與紅茶兩種工法製作的紅烏龍，茶湯呈現琥珀色，茶質厚重具熟果香，滋味醇厚圓滑，耐泡又甘醇的特性，熱泡順口、冷泡清甜。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103359_ada17.jpg&quot; /><br />\n<br />\n【柚香烏龍茶】產地：台東與鹿野<br />\n選用台東東河大白柚及鹿野手工摘採清心烏龍茶製作而成。<br />\n手工自製加上獨特製作過程，將柚子果肉挖出與茶葉混合後塞回柚身內，<br />\n經歷九蒸九曬與三十八星期風乾熟成後，才能將其敲碎入袋。<br />\n獨特的釀造方法，賦予了清新柚香與濃郁烏龍茶的完美組合。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103928_2d511.jpg&quot; /><br />\n<br />\n<strong>養氣</strong>-調養生活壓力，補充每日元氣。<br />\n茶款：<strong>牛樟凍頂烏龍茶、茉莉紅茶。</strong><br />\n<br />\n【牛樟凍頂烏龍茶】產地：南投鹿谷<br />\n使用台灣南投鹿谷特有凍頂烏龍茶，加上台灣最優質牛樟芝子實體，融合而成特殊香氣與口感，茶湯水色呈現金黃色，清香撲鼻，喉韻回甘。<br />\n(牛樟芝子實體由純菇體直接低溫研磨與萃取，富含牛樟芝子實體三萜類等指標生理活性成分，活性多醣體、SOD及腺苷等)<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180828090837_304f9.jpg&quot; /><br />\n<br />\n【茉莉紅茶】產地：彰化與梨山<br />\n選用台灣彰化花壇所種植安全無毒的茉莉花，以及高海拔梨山紅茶。以特殊「窨香」製法，將手工採收的茉莉花混合茶葉薰香乾燥，讓茶吸收花的香氣而成。茶湯溫潤澄透，花香高雅、茶湯潤口，風味細緻內斂。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827103946_3023f.jpg&quot; /><br />\n<br />\n<strong>養顏</strong>-保持青春容貌，給您一整天的好心情。<br />\n茶款：<strong>洛神玫瑰、蕎麥龍眼、檸檬瑪利格、茱莉亞藍玫瑰、馬鞭紫羅蘭</strong><br />\n<br />\n【洛神玫瑰】產地：台東、南投埔里、雲林<br />\n濃郁酸甜的洛神玫瑰香氣，放鬆紓壓有助於睡眠。<br />\n無添加咖啡因、色素、香精。茶中的甜味是由甜菊天然提味，無添加代糖與其他加工糖品，健康天然且熱量低不易發胖。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144707_e726c.jpg&quot; /><br />\n<br />\n【蕎麥龍眼】產地：台南林二 、雲林<br />\n濃厚的蕎麥香氣，口感清甜 後味回甘強烈。輕鬆解開身體的渴。<br />\n無添加咖啡因、色素、香精。茶中的甜味是由甜菊天然提味，無添加代糖與其他加工糖品，健康天然且熱量低不易發胖。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180827104521_de04b.jpg&quot; /><br />\n<br />\n【檸檬瑪利格】產地：雲林、屏東、花蓮<br />\n清新甘甜的口感，帶著悠悠果香與檸檬香氣，補充日常的元氣。<br />\n無添加咖啡因、色素、香精。茶中的甜味是由甜菊天然提味，無添加代糖與其他加工糖品，健康天然且熱量低不易發胖。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144709_6f006.jpg&quot; /><br />\n<br />\n【茱莉亞藍玫瑰】產地：花蓮、南投埔里、雲林<br />\n芬芳微甜並帶著玫瑰香氣，解開紊亂不安的煩躁心情。<br />\n無添加咖啡因、色素、香精。茶中的甜味是由甜菊天然提味，無添加代糖與其他加工糖品，健康天然且熱量低不易發胖。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144705_649c5.jpg&quot; /><br />\n<br />\n【馬鞭紫羅蘭】產地：雲林、屏東<br />\n微酸甜的美好滋味搭配淡淡花香，舒緩你的身心理。<br />\n無添加咖啡因、色素、香精。茶中的甜味是由甜菊天然提味，無添加代糖與其他加工糖品，健康天然且熱量低不易發胖。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144710_f2900.jpg&quot; /><br />\n<br />\n天然有機，不添加色素、咖啡因等 化學物質。堅持給您享受最天然健康的飲品。<br />\n顛覆傳統茶色思維，給您不同凡響的茶饗宴。<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20180806144715_790cd.jpg&quot; />', '', '', 33, NULL, 13.0, 0, 0, 0, 'TW', 'N', '2018-09-10 14:33:23', '2018-09-13 11:00:53', 1, 0, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `products` VALUES(255, 'fa fa-heart-o', 'N', 'N', 0, 0, 1, 'N', 'N', 1, '', NULL, 'test【洛神玫瑰】養顏/三神八福系列', 'p0a699848f9a74208d78f9f551d21a519.jpg', '*#【養顏-保持青春容貌，給您一整天的好心情。】*#我們聽見您講究品質的聲音，我們看見您想要獨創一格的新興茶品。*#來自台灣的嚴選好茶，集合著「養身、養氣、養顏」三大類別。*#天然嚴選好茶到精心設計禮盒， 讓您喝得健康活力、嚐得各式茶款甘甜。*#*#這世上的花花草草都是大自然的恩賜，擁有著不可思議的神奇自然能量~*#花草茶不僅適用在日常保健、還有養顏美容，放鬆身心的效果。*#鮮豔繽紛的茶色來自台灣天然有機的花草調和而成，絕不添加香精、色素等化學成分。*#飲茶入口時的甜味來自甜菊成分的天然提味，低熱量零負擔，讓您隨時都能享用。*#無添加咖啡因，怕喝茶睡不著的你可以放心飲用~', '', '', '20.00', '20.00', '20.00', '*#重量：*#生產地：*#製造地：*#成分：*#保存期限：*#保存方法：', '*#2g*10入*#台灣*#台灣*#台東 洛神、雲林 甜菊、南投埔里 玫瑰天竺葵*#三年*#置於陰涼乾燥處，避免陽光照射。', '0', '', 10, '', '<img alt=&quot;&quot; src=&quot;/uploads/products/images/20190124101009_9fd51.gif&quot; />\n<div style=&quot;text-align:center&quot;><br />\n&nbsp;</div>\n\n<div style=&quot;text-align:center&quot;>&nbsp;&mdash;&nbsp; 每一口就像享受著愛情般微酸微甜的美好，人生就該是這種美好的感覺。&mdash;</div>\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20190124101010_7e988.gif&quot; />\n<div style=&quot;text-align:center&quot;><br />\n<br />\n&mdash;&nbsp;&nbsp;洛神花與玫瑰天竺葵的特有風味，讓心靈與身體皆獲得解放，舒緩一天緊繃的情緒，甜甜的進入夢鄉。&mdash;</div>\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20190124101011_6c2c1.gif&quot; />\n<div style=&quot;text-align:center&quot;><br />\n<br />\n&mdash;&nbsp; 天然健康無負擔！久泡不苦澀、冷熱沖泡有不同口感~驚艷口感，顛覆你對花草茶的想像！&mdash;&nbsp;</div>\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20190124101011_11198.gif&quot; />\n<div style=&quot;text-align:center&quot;><br />\n&mdash;&nbsp; 嚴選有機農場孕育的天然花草茶&nbsp;&mdash;&nbsp;</div>\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20190124101012_5151c.gif&quot; />\n<div style=&quot;text-align:center&quot;><br />\n<br />\n&mdash;&nbsp;&nbsp;有機農場採收下的作物，於無塵室以香氣低損耗方式加工，使花草茶的香氣更自然、迷人&nbsp;&mdash;&nbsp;</div>\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20190124101012_31a2f.gif&quot; /><br />\n&nbsp;\n<div style=&quot;text-align:center&quot;>&nbsp;</div>\n\n<div style=&quot;text-align:center&quot;>&mdash;&nbsp; 獨特加工處理，冷泡比熱泡更好喝！冷熱的雙重驚艷口感、久泡不苦澀！顛覆你對花草茶的想像！ &mdash;&nbsp;</div>\n<br />\n<img alt=&quot;&quot; src=&quot;/uploads/products/images/20190124101013_b3ff0.gif&quot; />', '', '', 33, NULL, 4.0, 0, 0, 0, 'TW', 'Y', '2019-01-24 10:35:49', '2019-07-22 18:54:16', 0, 0, '', '', '', 0, 0, 0, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL);
