INSERT INTO `q_and_a` VALUES(3, 4, '會員是否有時效性？', '任一會員身份，經審核通過後，非經本人申請退會，會員資格永久有效。', 0, 'TW', '1', '2019-03-06 11:43:52', '2019-03-06 11:43:52');
INSERT INTO `q_and_a` VALUES(4, 4, '如何成為進階會員？', '一般會員於本網站完成一次有效消費，經審核通過(約10~15個工作天)即可成為進階會員。', 0, 'TW', '1', '2019-03-06 11:44:06', '2019-03-06 11:44:06');
INSERT INTO `q_and_a` VALUES(5, 3, '下訂單後多久可收到貨？', '完成付款後約3~5個工作天可到貨，如有特殊情況將另行通知。', 0, 'TW', '1', '2019-03-06 11:44:21', '2019-03-06 11:44:21');
INSERT INTO `q_and_a` VALUES(6, 4, '如何辦理退貨？', '欲辦理退貨，請直接<a href=\"/gold/contact\">與我們聯繫</a>，等候本公司與您聯繫退貨事宜。如因個人因素申請退貨，需自行負擔退貨運費。', 0, 'TW', '0', '2019-03-06 11:45:06', '2019-03-06 11:45:06');
INSERT INTO `q_and_a` VALUES(7, 6, 'Apakah keanggotaan itu sensitif terhadap waktu?', 'Setelah status anggota diverifikasi dan disetujui, status keanggotaan akan berlaku selamanya kecuali saya menarik diri dari keanggotaan.', 0, 'IND', '1', '2019-12-19 17:41:33', '2019-12-19 17:41:33');
INSERT INTO `q_and_a` VALUES(8, 6, 'Bagaimana cara saya menjadi Anggota Lanjutan?', 'Anggota umum menyelesaikan pembelian yang efektif di situs web ini, dan setelah melewati ulasan (sekitar 10-15 hari kerja), mereka dapat menjadi anggota lanjut.', 0, 'IND', '1', '2019-12-19 17:42:33', '2019-12-19 17:42:33');
